INSERT INTO `module_cms_detail` VALUES ('99', '25', '1', 'Massage Elements', '', '<p>The eyes are the most precious, beautiful and sensitive parts on your face. Proper care needs to be given to the eye and given back their freshness from time to time so that they stay healthy and beautiful. Eye massage is becoming increasingly popular among those with tired eyes and is known to be a great way to beat stress and fell and see better! So here come the tips.</p>\r\n<p>Keep eyes closed. Using the middle finger, massage the eye-socket bones. Move your fingers outwards and upwards, then down to the bridge of the nose. Repeat 8-10 times.</p>\r\n<p>Press the pressure points just under the brow bone below the inner eyebrows and count to 3. Then glide fingers under brow, around and under the eyes, and back to the starting point in 6 counts. Repeat entire procedure 3 times, moving gently over the eyelid to press at temples on the final count.</p>\r\n<p>Using your thumbs, gently press on the area right above the inner corner of the eyes where the crease of your lid begins. Press slowly and release. Repeat this exercise 5 times.</p>\r\n<p>Using your middle fingers, massage the hollow area which is located in the temples on the side of your face using an up and down motion. Continue to massage the area for 1 minute.</p>\r\n<p>Using the tips of your index fingers, gently massage the area located in the back of the skull, directly behind the eyes. Take care not to press to hard since this is a tender spot. Continue to massage the area for 1 minute.</p>', null);
