INSERT INTO `module_cms_detail` VALUES ('119', '30', '1', 'element', '', '<p><span><img src=\"/resource/module-cms/tinymce/320x480-free-iphone-wallpaper.jpg\" alt=\"\" />Most of the human body is made up of water, H</span><sub>2</sub><span>O, with cells consisting of 65-90% water by weight. Therefore, it isn\'t surprising that most of a human body\'s mass is oxygen. Carbon, the basic unit for organic molecules, comes in second. 99% of the mass of the human body is made up of just six elements: oxygen, carbon, hydrogen, nitrogen, calcium, and phosphorus.</span></p>', '');
