INSERT INTO `module_cms_detail` VALUES ('150', '39', '3', 'info Pevonia Botanica', '', '<p><img title=\"pevonia_header.jpg\" src=\"/resource/module-image-gallery/images/pevonia_header.jpg\" alt=\"pevonia_header.jpg\" width=\"100%\" /></p>\r\n<p><strong>Pevonia Botanica</strong>&nbsp;ist eine SPA Pflegelinie, augew&auml;hlt von den sch&ouml;nsten und bekanntesten SPA\'s und Kosmetikinstituten weltweit. Pevonia bietet &uuml;ber 150 spezielle Heimbehandlungen und mehr als 100 professionelle Behandlungen an. Die effektive Pflege f&uuml;r Sie und Ihn jeden Hauttyps.</p>\r\n<p><strong>Das Beste des Meeres und der Erde...</strong>&nbsp;Die reinsten, nat&uuml;rlichen Elemente des Meeres und der Erde werden im Hightechverfahren harmonisiert f&uuml;r ein unglaubliches sichtbares Resultat und ein un&uuml;bertroffenes SPA Erlebnis.</p>\r\n<p><strong>Behandlungseffizienz</strong>&nbsp;durch hochqualifizierte und ausgebildete Kosmetikerinnen. Gesichts- und K&ouml;rperbehandlungen sind speziell auf jeden Hauttyp abgestimmt. Die Behandlung im Studio wird durch die Produkte f&uuml;r zu Hause abgerundet.<em>&nbsp;</em></p>\r\n<p><strong><em>\"Eine Affinit&auml;t zur Natur...\"</em></strong>&nbsp;Pevonia h&auml;lt eine harmonische Balance zu den wertvollsten Rohstoffen. Die Verpackungen sind komplett biologisch abbaubar und auf Tierversuche wird in jeglicher Form verzichtet.</p>', null);
INSERT INTO `module_cms_detail` VALUES ('151', '39', '4', 'info Pevonia Botanica', '', '<p><img title=\"pevonia_header.jpg\" src=\"../../resource/module-image-gallery/images/pevonia_header.jpg\" alt=\"pevonia_header.jpg\" width=\"100%\" /></p>\r\n<p><strong>Pevonia Botanica</strong>&nbsp;ist eine SPA Pflegelinie, augew&auml;hlt von den sch&ouml;nsten und bekanntesten SPA\'s und Kosmetikinstituten weltweit. Pevonia bietet &uuml;ber 150 spezielle Heimbehandlungen und mehr als 100 professionelle Behandlungen an. Die effektive Pflege f&uuml;r Sie und Ihn jeden Hauttyps.</p>\r\n<p><strong>Das Beste des Meeres und der Erde...</strong>&nbsp;Die reinsten, nat&uuml;rlichen Elemente des Meeres und der Erde werden im Hightechverfahren harmonisiert f&uuml;r ein unglaubliches sichtbares Resultat und ein un&uuml;bertroffenes SPA Erlebnis.</p>\r\n<p><strong>Behandlungseffizienz</strong>&nbsp;durch hochqualifizierte und ausgebildete Kosmetikerinnen. Gesichts- und K&ouml;rperbehandlungen sind speziell auf jeden Hauttyp abgestimmt. Die Behandlung im Studio wird durch die Produkte f&uuml;r zu Hause abgerundet.<em>&nbsp;</em></p>\r\n<p><strong><em>\"Eine Affinit&auml;t zur Natur...\"</em></strong>&nbsp;Pevonia h&auml;lt eine harmonische Balance zu den wertvollsten Rohstoffen. Die Verpackungen sind komplett biologisch abbaubar und auf Tierversuche wird in jeglicher Form verzichtet.</p>', null);
INSERT INTO `module_cms_detail` VALUES ('152', '39', '1', 'info Pevonia Botanica', '', '<p><img title=\"Blue hills.jpg\" src=\"/resource/module-image-gallery/thumb/3/Blue hills.jpg\" alt=\"Blue hills.jpg\" width=\"100%\" height=\"75\" /></p>\r\n<p><strong>Pevonia Botanica</strong>&nbsp;ist eine SPA Pflegelinie, augew&auml;hlt von den sch&ouml;nsten und bekanntesten SPA\'s und Kosmetikinstituten weltweit. Pevonia bietet &uuml;ber 150 spezielle Heimbehandlungen und mehr als 100 professionelle Behandlungen an. Die effektive Pflege f&uuml;r Sie und Ihn jeden Hauttyps...</p>\r\n<p><strong>Das Beste des Meeres und der Erde...</strong>&nbsp;Die reinsten, nat&uuml;rlichen Elemente des Meeres und der Erde werden im Hightechverfahren harmonisiert f&uuml;r ein unglaubliches sichtbares Resultat und ein un&uuml;bertroffenes SPA Erlebnis.</p>\r\n<p><strong>Behandlungseffizienz</strong>&nbsp;durch hochqualifizierte und ausgebildete Kosmetikerinnen. Gesichts- und K&ouml;rperbehandlungen sind speziell auf jeden Hauttyp abgestimmt. Die Behandlung im Studio wird durch die Produkte f&uuml;r zu Hause abgerundet.<em>&nbsp;</em></p>\r\n<p><strong><em>\"Eine Affinit&auml;t zur Natur...\"</em></strong>&nbsp;Pevonia h&auml;lt eine harmonische Balance zu den wertvollsten Rohstoffen. Die Verpackungen sind komplett biologisch abbaubar und auf Tierversuche wird in jeglicher Form verzichtet.</p>', null);
INSERT INTO `module_cms_detail` VALUES ('153', '39', '2', 'info Pevonia Botanica', '', '<p><img title=\"pevonia_header.jpg\" src=\"../../resource/module-image-gallery/images/pevonia_header.jpg\" alt=\"pevonia_header.jpg\" width=\"100%\" /></p>\r\n<p><strong>Pevonia Botanica</strong>&nbsp;ist eine SPA Pflegelinie, augew&auml;hlt von den sch&ouml;nsten und bekanntesten SPA\'s und Kosmetikinstituten weltweit. Pevonia bietet &uuml;ber 150 spezielle Heimbehandlungen und mehr als 100 professionelle Behandlungen an. Die effektive Pflege f&uuml;r Sie und Ihn jeden Hauttyps.</p>\r\n<p><strong>Das Beste des Meeres und der Erde...</strong>&nbsp;Die reinsten, nat&uuml;rlichen Elemente des Meeres und der Erde werden im Hightechverfahren harmonisiert f&uuml;r ein unglaubliches sichtbares Resultat und ein un&uuml;bertroffenes SPA Erlebnis.</p>\r\n<p><strong>Behandlungseffizienz</strong>&nbsp;durch hochqualifizierte und ausgebildete Kosmetikerinnen. Gesichts- und K&ouml;rperbehandlungen sind speziell auf jeden Hauttyp abgestimmt. Die Behandlung im Studio wird durch die Produkte f&uuml;r zu Hause abgerundet.<em>&nbsp;</em></p>\r\n<p><strong><em>\"Eine Affinit&auml;t zur Natur...\"</em></strong>&nbsp;Pevonia h&auml;lt eine harmonische Balance zu den wertvollsten Rohstoffen. Die Verpackungen sind komplett biologisch abbaubar und auf Tierversuche wird in jeglicher Form verzichtet.</p>', null);
INSERT INTO `module_cms_detail` VALUES ('154', '40', '3', 'Festival Pin', 'thumb-tickets-bb.jpg', '<p><span style=\"font-family: arial, helvetica, sans-serif;\">Von den Besuchern, die kein Konzert-Ticket haben, wird erwartet, dass Sie einen Festival-Pin&nbsp;im Wert von CHF 20.- kaufen. Diese werden auf dem Areal von Pin Verk&auml;ufern oder an der&nbsp;Abendkasse im KKL verkauft.</span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif;\">Der Pin ist an neun Tagen g&uuml;ltig f&uuml;r: KKL Plaza-Konzerte, KKL&nbsp;Seebar-Konzerte, Video-Lounge, Foto-Expo, Kunst, Film, Pavillon-Konzerte, Schweizerhof-</span><span style=\"font-family: arial, helvetica, sans-serif;\">Konzerte und Boatshuttle.</span></p>', null);
