INSERT INTO `module_cms_detail` VALUES ('362', '98', '1', 'D', 'd_1.jpg', '<p>&nbsp;</p>\r\n<pre class=\"default prettyprint prettyprinted\"><strong>Android</strong><span>&nbsp;is a&nbsp;</span><a title=\"Linux\" href=\"http://en.wikipedia.org/wiki/Linux\">Linux</a><span>-based&nbsp;</span><a title=\"Mobile operating system\" href=\"http://en.wikipedia.org/wiki/Mobile_operating_system\">operating system</a><span>&nbsp;designed primarily for&nbsp;</span><a title=\"Touchscreen\" href=\"http://en.wikipedia.org/wiki/Touchscreen\">touchscreen</a><span>&nbsp;mobile devices such as&nbsp;</span><a title=\"Smartphone\" href=\"http://en.wikipedia.org/wiki/Smartphone\">smartphones</a><span>&nbsp;and&nbsp;</span><a title=\"Tablet computer\" href=\"http://en.wikipedia.org/wiki/Tablet_computer\">tablet computers</a><span>. Initially developed by Android, Inc., which&nbsp;</span><a title=\"Google\" href=\"http://en.wikipedia.org/wiki/Google\">Google</a><span>&nbsp;backed financially and later purchased in 2005,</span></pre>\r\n<p><sup id=\"cite_ref-AndroidInc_9-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Android_(operating_system)#cite_note-AndroidInc-9\">[9]</a></sup></p>\r\n<pre class=\"default prettyprint prettyprinted\"><span>&nbsp;Android was unveiled in 2007 along with the founding of the&nbsp;</span><a title=\"Open Handset Alliance\" href=\"http://en.wikipedia.org/wiki/Open_Handset_Alliance\">Open Handset Alliance</a><span>: a consortium of&nbsp;</span><a title=\"Computer hardware\" href=\"http://en.wikipedia.org/wiki/Computer_hardware\">hardware</a><span>,</span><a title=\"Software\" href=\"http://en.wikipedia.org/wiki/Software\">software</a><span>, and&nbsp;</span><a title=\"Telecommunication\" href=\"http://en.wikipedia.org/wiki/Telecommunication\">telecommunication</a><span>&nbsp;companies devoted to advancing&nbsp;</span><a title=\"Open standard\" href=\"http://en.wikipedia.org/wiki/Open_standard\">open standards</a><span>&nbsp;for mobile devices.</span></pre>\r\n<p><sup id=\"cite_ref-AndroidAnnouncement_10-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Android_(operating_system)#cite_note-AndroidAnnouncement-10\">[10]</a></sup></p>\r\n<pre class=\"default prettyprint prettyprinted\"><span>&nbsp;The first Android-powered phone was sold in October 2008.</span></pre>\r\n<p><sup id=\"cite_ref-11\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Android_(operating_system)#cite_note-11\">[11]</a></sup></p>', null);
