INSERT INTO `module_cms_detail` VALUES ('366', '99', '1', 'E', 'e.jpg', '<p>E</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span>The band formed upon the breakup of&nbsp;</span><a title=\"JamisonParker\" href=\"http://en.wikipedia.org/wiki/JamisonParker\">JamisonParker</a><span>&nbsp;and was originally called Dance With The Dead, strictly being a solo project of Covington. Covington would later change the name of the project to \"Covington,\" and release a number of demos under that moniker. He then recruited touring musicians and began playing under the name \"E For Explosion,\" a name chosen because of Covington\'s admiration of&nbsp;</span><a title=\"Science fiction\" href=\"http://en.wikipedia.org/wiki/Science_fiction\">science fiction</a><span>&nbsp;writer&nbsp;</span><a title=\"Ray Bradbury\" href=\"http://en.wikipedia.org/wiki/Ray_Bradbury\">Ray Bradbury</a><span>.</span><sup id=\"cite_ref-1\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/E_For_Explosion#cite_note-1\">[1]</a></sup><span>After the band released an EP, they were signed to&nbsp;</span><a title=\"Eyeball Records\" href=\"http://en.wikipedia.org/wiki/Eyeball_Records\">Eyeball Records</a><span>&nbsp;and released their debut album&nbsp;</span><a title=\"Reinventing the Heartbeat\" href=\"http://en.wikipedia.org/wiki/Reinventing_the_Heartbeat\">Reinventing the Heartbeat</a><span>&nbsp;on May 20, 2008.</span><sup id=\"cite_ref-label_2-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/E_For_Explosion#cite_note-label-2\">[2]</a></sup></p>', null);
