INSERT INTO `module_cms_detail` VALUES ('370', '100', '1', 'F', 'f.png', '<p>F</p>\r\n<p>&nbsp;</p>\r\n<p><span>The origin of \'F\' is the&nbsp;</span><a title=\"Semitic languages\" href=\"http://en.wikipedia.org/wiki/Semitic_languages\">Semitic</a><span>&nbsp;letter&nbsp;</span><a title=\"Waw (letter)\" href=\"http://en.wikipedia.org/wiki/Waw_(letter)\"><em>v&acirc;v</em></a><span>&nbsp;(or&nbsp;</span><em>waw</em><span>) that represented a sound like&nbsp;</span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\">/v/</span><span>&nbsp;or&nbsp;</span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\">/w/</span><span>. Graphically, it originally probably depicted either a hook or a club. It may have been based on a comparable&nbsp;</span><a class=\"mw-redirect\" title=\"Egyptian hieroglyph\" href=\"http://en.wikipedia.org/wiki/Egyptian_hieroglyph\">Egyptian hieroglyph</a><span>, such as&nbsp;</span><a class=\"mw-redirect\" title=\"List of Egyptian hieroglyphs by common name: M-Z\" href=\"http://en.wikipedia.org/wiki/List_of_Egyptian_hieroglyphs_by_common_name:_M-Z#M\">that which represented the word&nbsp;<em>mace</em></a></p>', null);
