INSERT INTO `module_cms_detail_1` VALUES ('62', '17', '1', 'Pakistan', 'Pak.jpg', '<p>Pakistan</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Pakistan</strong>&nbsp;(<span class=\"nowrap\"><span class=\"noexcerpt\"><a title=\"Listen\" href=\"http://upload.wikimedia.org/wikipedia/commons/b/b2/En-us-Pakistan.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png\" alt=\"Listen\" width=\"11\" height=\"11\" /></a><sup><span class=\"IPA\"><a title=\"File:En-us-Pakistan.ogg\" href=\"http://en.wikipedia.org/wiki/File:En-us-Pakistan.ogg\">i</a></span></sup></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'p\' in \'pie\'\">p</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/&aelig;/ short \'a\' in \'bad\'\">&aelig;</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'k\' in \'kind\'\">k</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É¨/ \'e\' in \'roses\'\">É¨</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'t\' in \'tie\'\">t</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/&aelig;/ short \'a\' in \'bad\'\">&aelig;</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;or&nbsp;<span class=\"nowrap\"><span class=\"noexcerpt\"><a title=\"Listen\" href=\"http://upload.wikimedia.org/wikipedia/commons/9/9f/En-us-Pakistan-2.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png\" alt=\"Listen\" width=\"11\" height=\"11\" /></a><sup><span class=\"IPA\"><a title=\"File:En-us-Pakistan-2.ogg\" href=\"http://en.wikipedia.org/wiki/File:En-us-Pakistan-2.ogg\">i</a></span></sup></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'p\' in \'pie\'\">p</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É‘Ë/ \'a\' in \'father\'\">É‘Ë</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'k\' in \'kind\'\">k</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/i/ \'y\' in \'happy\'\">i</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'t\' in \'tie\'\">t</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É‘Ë/ \'a\' in \'father\'\">É‘Ë</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>;&nbsp;<a title=\"Urdu\" href=\"http://en.wikipedia.org/wiki/Urdu\">Urdu</a>:&nbsp;<span lang=\"ur\"><span title=\"Nasta\'liq\" lang=\"und-Arab\"><span><a class=\"extiw\" title=\"wikt:Ù¾Ø§ÙƒÙØ³ØªØ§Ù†\" href=\"http://en.wiktionary.org/wiki/%D9%BE%D8%A7%D9%83%D9%90%D8%B3%D8%AA%D8%A7%D9%86\">Ù¾Ø§ÙƒÙØ³ØªØ§Ù†</a></span></span></span>&lrm;) (<small>Urdu pronunciation:&nbsp;</small><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for Hindi and Urdu\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_Hindi_and_Urdu\">[paËkÉªËˆstÌªaËn]</a></span><small class=\"nowrap\">&nbsp;(<a title=\"File:Pakistan pronunciation.ogg\" href=\"http://en.wikipedia.org/wiki/File:Pakistan_pronunciation.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/2/21/Speaker_Icon.svg/13px-Speaker_Icon.svg.png\" alt=\"\" width=\"13\" height=\"13\" /></a>&nbsp;<a class=\"internal\" title=\"Pakistan pronunciation.ogg\" href=\"http://upload.wikimedia.org/wikipedia/en/d/d8/Pakistan_pronunciation.ogg\">listen</a>)</small>), officially the&nbsp;<strong>Islamic Republic of Pakistan</strong>(<a title=\"Urdu\" href=\"http://en.wikipedia.org/wiki/Urdu\">Urdu</a>:&nbsp;<span lang=\"ur\"><span title=\"Nasta\'liq\" lang=\"und-Arab\"><span>Ø§Ø³Ù„Ø§Ù…ÛŒ Ø¬Ù…ÛÙˆØ±ÛŒÛ‚ Ù¾Ø§ÙƒÙØ³ØªØ§Ù†</span></span></span>&lrm;), is a sovereign country in&nbsp;<a title=\"South Asia\" href=\"http://en.wikipedia.org/wiki/South_Asia\">South Asia</a>. With a population exceeding&nbsp;<a title=\"Demographics of Pakistan\" href=\"http://en.wikipedia.org/wiki/Demographics_of_Pakistan\">180 million people</a>, it is the sixth&nbsp;<a title=\"List of countries by population\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_population\">most populous</a>&nbsp;country in the world. Located at the crossroads of the strategically important regions of South Asia, Central Asia and Western Asia, Pakistan has a 1,046-kilometre (650&nbsp;mi) coastline along the&nbsp;<a title=\"Arabian Sea\" href=\"http://en.wikipedia.org/wiki/Arabian_Sea\">Arabian Sea</a>&nbsp;and the&nbsp;<a title=\"Gulf of Oman\" href=\"http://en.wikipedia.org/wiki/Gulf_of_Oman\">Gulf of Oman</a>&nbsp;in the south and is bordered by&nbsp;<a title=\"India\" href=\"http://en.wikipedia.org/wiki/India\">India</a>&nbsp;to the east,&nbsp;<a title=\"Afghanistan\" href=\"http://en.wikipedia.org/wiki/Afghanistan\">Afghanistan</a>&nbsp;to the west and north,&nbsp;<a title=\"Iran\" href=\"http://en.wikipedia.org/wiki/Iran\">Iran</a>&nbsp;to the southwest and&nbsp;<a title=\"China\" href=\"http://en.wikipedia.org/wiki/China\">China</a>&nbsp;in the far northeast. It is separated from&nbsp;<a title=\"Tajikistan\" href=\"http://en.wikipedia.org/wiki/Tajikistan\">Tajikistan</a>&nbsp;by Afghanistan\'s narrow&nbsp;<a title=\"Wakhan Corridor\" href=\"http://en.wikipedia.org/wiki/Wakhan_Corridor\">Wakhan Corridor</a>in the north, and also shares a&nbsp;<a class=\"mw-redirect\" title=\"Marine border\" href=\"http://en.wikipedia.org/wiki/Marine_border\">marine border</a>&nbsp;with&nbsp;<a title=\"Oman\" href=\"http://en.wikipedia.org/wiki/Oman\">Oman</a>.</p>\r\n<p>The territory of modern Pakistan was home to several ancient cultures, including the Neolithic&nbsp;<a title=\"Mehrgarh\" href=\"http://en.wikipedia.org/wiki/Mehrgarh\">Mehrgarh</a>&nbsp;and the Bronze Age&nbsp;<a class=\"mw-redirect\" title=\"Indus Valley Civilisation\" href=\"http://en.wikipedia.org/wiki/Indus_Valley_Civilisation\">Indus Valley Civilisation</a>, and has undergone invasions or settlements by&nbsp;<a title=\"Hindu\" href=\"http://en.wikipedia.org/wiki/Hindu\">Hindu</a>,&nbsp;<a title=\"Iranian peoples\" href=\"http://en.wikipedia.org/wiki/Iranian_peoples\">Persian</a>,&nbsp;<a class=\"mw-redirect\" title=\"Indo-Greek\" href=\"http://en.wikipedia.org/wiki/Indo-Greek\">Indo-Greek</a>,&nbsp;<a title=\"Muslim conquest in the Indian subcontinent\" href=\"http://en.wikipedia.org/wiki/Muslim_conquest_in_the_Indian_subcontinent\">Islamic</a>,&nbsp;<a title=\"Timurid dynasty\" href=\"http://en.wikipedia.org/wiki/Timurid_dynasty\">Turco-Mongol</a>,<a title=\"Afghan (ethnonym)\" href=\"http://en.wikipedia.org/wiki/Afghan_(ethnonym)\">Afghan</a>&nbsp;and&nbsp;<a title=\"Sikh\" href=\"http://en.wikipedia.org/wiki/Sikh\">Sikh</a>&nbsp;cultures. The area has been ruled by numerous empires and dynasties, including the Indian&nbsp;<a class=\"mw-redirect\" title=\"Mauryan Empire\" href=\"http://en.wikipedia.org/wiki/Mauryan_Empire\">Mauryan Empire</a>, the Persian&nbsp;<a title=\"Achaemenid Empire\" href=\"http://en.wikipedia.org/wiki/Achaemenid_Empire\">Achaemenid Empire</a>, the Arab&nbsp;<a title=\"Umayyad Caliphate\" href=\"http://en.wikipedia.org/wiki/Umayyad_Caliphate\">Umayyad Caliphate</a>, the&nbsp;<a title=\"Mongol Empire\" href=\"http://en.wikipedia.org/wiki/Mongol_Empire\">Mongol Empire</a>, the&nbsp;<a title=\"Mughal Empire\" href=\"http://en.wikipedia.org/wiki/Mughal_Empire\">Mughal Empire</a>, the&nbsp;<a title=\"Durrani Empire\" href=\"http://en.wikipedia.org/wiki/Durrani_Empire\">Durrani Empire</a>, the&nbsp;<a title=\"Sikh Empire\" href=\"http://en.wikipedia.org/wiki/Sikh_Empire\">Sikh Empire</a>&nbsp;and the&nbsp;<a title=\"British Raj\" href=\"http://en.wikipedia.org/wiki/British_Raj\">British Empire</a>. As a result of the&nbsp;<a title=\"Pakistan Movement\" href=\"http://en.wikipedia.org/wiki/Pakistan_Movement\">Pakistan Movement</a>&nbsp;led by&nbsp;<a title=\"Muhammad Ali Jinnah\" href=\"http://en.wikipedia.org/wiki/Muhammad_Ali_Jinnah\">Muhammad Ali Jinnah</a>&nbsp;and&nbsp;<a title=\"Indian independence movement\" href=\"http://en.wikipedia.org/wiki/Indian_independence_movement\">India\'s struggle for independence</a>, Pakistan was&nbsp;<a title=\"Indian Independence Act 1947\" href=\"http://en.wikipedia.org/wiki/Indian_Independence_Act_1947\">created in 1947</a>&nbsp;as an independent nation for Muslims from the regions in the east and west of India where there was a Muslim majority. Initially a&nbsp;<a title=\"Dominion of Pakistan\" href=\"http://en.wikipedia.org/wiki/Dominion_of_Pakistan\">dominion</a>, Pakistan adopted a&nbsp;<a title=\"Constitution of Pakistan\" href=\"http://en.wikipedia.org/wiki/Constitution_of_Pakistan\">new constitution</a>&nbsp;in 1956, becoming an&nbsp;<a title=\"Islamic republic\" href=\"http://en.wikipedia.org/wiki/Islamic_republic\">Islamic republic</a>. A&nbsp;<a title=\"Bangladesh Liberation War\" href=\"http://en.wikipedia.org/wiki/Bangladesh_Liberation_War\">civil war</a>&nbsp;in 1971 resulted in the secession of&nbsp;<a title=\"East Pakistan\" href=\"http://en.wikipedia.org/wiki/East_Pakistan\">East Pakistan</a>&nbsp;as the new country of<a title=\"Bangladesh\" href=\"http://en.wikipedia.org/wiki/Bangladesh\">Bangladesh</a>.</p>\r\n<p>Pakistan is a&nbsp;<a title=\"Federation\" href=\"http://en.wikipedia.org/wiki/Federation\">federal</a>&nbsp;<a title=\"Parliamentary republic\" href=\"http://en.wikipedia.org/wiki/Parliamentary_republic\">parliamentary republic</a>&nbsp;consisting of&nbsp;<a title=\"Administrative units of Pakistan\" href=\"http://en.wikipedia.org/wiki/Administrative_units_of_Pakistan\">four provinces and four federal territories</a>. It is an&nbsp;<a title=\"Ethnic groups in Pakistan\" href=\"http://en.wikipedia.org/wiki/Ethnic_groups_in_Pakistan\">ethnically</a>&nbsp;and&nbsp;<a title=\"Languages of Pakistan\" href=\"http://en.wikipedia.org/wiki/Languages_of_Pakistan\">linguistically</a>&nbsp;diverse country, with a similar variation in its&nbsp;<a title=\"Geography of Pakistan\" href=\"http://en.wikipedia.org/wiki/Geography_of_Pakistan\">geography</a>&nbsp;and&nbsp;<a title=\"Fauna of Pakistan\" href=\"http://en.wikipedia.org/wiki/Fauna_of_Pakistan\">wildlife</a>. A&nbsp;<a title=\"Regional power\" href=\"http://en.wikipedia.org/wiki/Regional_power\">regional</a>&nbsp;and&nbsp;<a title=\"Middle power\" href=\"http://en.wikipedia.org/wiki/Middle_power\">middle power</a>,<sup id=\"cite_ref-Buzan2004_11-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Pakistan#cite_note-Buzan2004-11\">[10]</a></sup><sup id=\"cite_ref-Solomon_12-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Pakistan#cite_note-Solomon-12\">[11]</a></sup>&nbsp;Pakistan has the&nbsp;<a class=\"mw-redirect\" title=\"List of countries by number of troops\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_number_of_troops\">seventh largest standing armed forces</a>&nbsp;in the world and is also a&nbsp;<a title=\"Nuclear power in Pakistan\" href=\"http://en.wikipedia.org/wiki/Nuclear_power_in_Pakistan\">nuclear power</a>&nbsp;as well as a declared&nbsp;<a title=\"List of states with nuclear weapons\" href=\"http://en.wikipedia.org/wiki/List_of_states_with_nuclear_weapons\">nuclear weapons</a>&nbsp;state, being the only nation in the<a title=\"Muslim world\" href=\"http://en.wikipedia.org/wiki/Muslim_world\">Muslim world</a>, and the second in South Asia, to have that status. It has a semi-industrialised&nbsp;<a title=\"Economy of Pakistan\" href=\"http://en.wikipedia.org/wiki/Economy_of_Pakistan\">economy</a>&nbsp;which is the&nbsp;<a title=\"List of countries by GDP (PPP)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(PPP)\">27th largest</a>&nbsp;in the world in terms of purchasing power and&nbsp;<a title=\"List of countries by GDP (nominal)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(nominal)\">47th largest</a>&nbsp;in terms of nominal GDP.</p>\r\n<p>Pakistan\'s post-independence history has been characterised by periods of military rule, political instability and&nbsp;<a title=\"Indo-Pakistani wars and conflicts\" href=\"http://en.wikipedia.org/wiki/Indo-Pakistani_wars_and_conflicts\">conflicts with neighbouring India</a>. The country continues to face challenging problems, including&nbsp;<a title=\"Terrorism in Pakistan\" href=\"http://en.wikipedia.org/wiki/Terrorism_in_Pakistan\">terrorism</a>,&nbsp;<a title=\"Poverty in Pakistan\" href=\"http://en.wikipedia.org/wiki/Poverty_in_Pakistan\">poverty</a>,&nbsp;<a title=\"Education in Pakistan\" href=\"http://en.wikipedia.org/wiki/Education_in_Pakistan#Literacy_rate\">illiteracy</a>&nbsp;and&nbsp;<a title=\"Corruption in Pakistan\" href=\"http://en.wikipedia.org/wiki/Corruption_in_Pakistan\">corruption</a>. It is a founding member of the Organisation of the Islamic Conference (now the<a title=\"Organisation of Islamic Cooperation\" href=\"http://en.wikipedia.org/wiki/Organisation_of_Islamic_Cooperation\">Organisation of Islamic Cooperation</a>) and is a member of the&nbsp;<a title=\"United Nations\" href=\"http://en.wikipedia.org/wiki/United_Nations\">United Nations</a>, the<a title=\"Commonwealth of Nations\" href=\"http://en.wikipedia.org/wiki/Commonwealth_of_Nations\">Commonwealth of Nations</a>, the&nbsp;<a title=\"Next Eleven\" href=\"http://en.wikipedia.org/wiki/Next_Eleven\">Next Eleven Economies</a>,&nbsp;<a title=\"South Asian Association for Regional Cooperation\" href=\"http://en.wikipedia.org/wiki/South_Asian_Association_for_Regional_Cooperation\">SAARC</a>,&nbsp;<a class=\"mw-redirect\" title=\"Economic Cooperation Organisation\" href=\"http://en.wikipedia.org/wiki/Economic_Cooperation_Organisation\">ECO</a>,&nbsp;<a class=\"mw-redirect\" title=\"Developing Eight\" href=\"http://en.wikipedia.org/wiki/Developing_Eight\">D8</a>&nbsp;and the<a title=\"G20 developing nations\" href=\"http://en.wikipedia.org/wiki/G20_developing_nations\">G20 developing nations</a>.</p>', null);
