INSERT INTO `module_cms_detail_1` VALUES ('66', '18', '1', 'America', 'America.jpg', '<p>America</p>\r\n<p>&nbsp;<img src=\"../../../../../../resource/module-cms-1/tinymce/America.jpg\" alt=\"\" /></p>\r\n<p><strong>916 America</strong>&nbsp;is a&nbsp;<a title=\"Minor planet\" href=\"http://en.wikipedia.org/wiki/Minor_planet\">minor planet</a>&nbsp;orbiting the&nbsp;<a title=\"Sun\" href=\"http://en.wikipedia.org/wiki/Sun\">Sun</a>&nbsp;in the&nbsp;<a class=\"mw-redirect\" title=\"Main belt\" href=\"http://en.wikipedia.org/wiki/Main_belt\">main belt</a>&nbsp;between&nbsp;<a title=\"Mars\" href=\"http://en.wikipedia.org/wiki/Mars\">Mars</a>&nbsp;and&nbsp;<a title=\"Jupiter\" href=\"http://en.wikipedia.org/wiki/Jupiter\">Jupiter</a>.</p>\r\n<p>It was discovered on 7 August 1915 by the&nbsp;<a title=\"Russia\" href=\"http://en.wikipedia.org/wiki/Russia\">Russian</a>&nbsp;astronomer&nbsp;<a class=\"mw-redirect\" title=\"Grigory Nikolaevich Neujmin\" href=\"http://en.wikipedia.org/wiki/Grigory_Nikolaevich_Neujmin\">Grigory Nikolaevich Neujmin</a>&nbsp;at&nbsp;<a class=\"mw-redirect\" title=\"Simeis\" href=\"http://en.wikipedia.org/wiki/Simeis\">Simeis</a>,&nbsp;<a title=\"Ukraine\" href=\"http://en.wikipedia.org/wiki/Ukraine\">Ukraine</a>.<sup id=\"cite_ref-ssd_jpl_1-2\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/916_America#cite_note-ssd_jpl-1\">[1]</a></sup>&nbsp;Originally designated&nbsp;<strong>916<sup>&Sigma;</sup>I</strong>, it was renamed \'916 America\' on 24 February 1923 after the Council of Astronomers at&nbsp;<a title=\"Pulkovo Observatory\" href=\"http://en.wikipedia.org/wiki/Pulkovo_Observatory\">Pulkovo Observatory</a>&nbsp;decided to commemorate \"the friendly relations of the astronomical observatories and astronomers\".<sup id=\"cite_ref-2\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/916_America#cite_note-2\">[2]</a></sup>&nbsp;Another possible reason for the name was as a mark of appreciation for the help given during the 1921 Russian famine by the&nbsp;<a title=\"American Relief Administration\" href=\"http://en.wikipedia.org/wiki/American_Relief_Administration\">American Relief Administration</a>&nbsp;under the later President&nbsp;<a title=\"Herbert Hoover\" href=\"http://en.wikipedia.org/wiki/Herbert_Hoover\">Herbert Hoover</a>.<sup id=\"cite_ref-3\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/916_America#cite_note-3\">[3]</a></sup></p>\r\n<p>In 1986, assuming that the asteroid was of S-type and that it had a diameter of 15&nbsp;km, the rotational period was measured to be 38 hours.<sup id=\"cite_ref-1986_Dimartino_4-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/916_America#cite_note-1986_Dimartino-4\">[4]</a></sup>&nbsp;Observations by the&nbsp;<a title=\"IRAS\" href=\"http://en.wikipedia.org/wiki/IRAS\">Infrared Astronomical Satellite</a>&nbsp;have since shown that it has a diameter of 33.2&plusmn;1.3&nbsp;km, with an<a title=\"Absolute magnitude\" href=\"http://en.wikipedia.org/wiki/Absolute_magnitude\">absolute magnitude</a>&nbsp;of 11.20 and an&nbsp;<a title=\"Albedo\" href=\"http://en.wikipedia.org/wiki/Albedo\">albedo</a>&nbsp;of 0.053&plusmn;0.004.<sup id=\"cite_ref-ssd_jpl_1-3\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/916_America#cite_note-ssd_jpl-1\">[1]</a></sup></p>', null);
