INSERT INTO `module_cms_detail_1` VALUES ('110', '29', '3', 'Pevonia Botanica', 'pevonia-logo_2.png', '<p><img src=\"/resource/module-cms-1/tinymce/pevonia_header.jpg\" alt=\"\" width=\"100%\" /></p>\r\n<p><strong><strong>Pevonia Botanica</strong>&nbsp;</strong>ist eine SPA Pflegelinie, augew&auml;hlt von den sch&ouml;nsten und bekanntesten SPA\'s und Kosmetikinstituten weltweit. Pevonia bietet &uuml;ber 150 spezielle Heimbehandlungen und mehr als 100 professionelle Behandlungen an. Die effektive Pflege f&uuml;r Sie und Ihn jeden Hauttyps.</p>\r\n<p><strong>Das Beste des Meeres und der Erde...</strong>&nbsp;Die reinsten, nat&uuml;rlichen Elemente des Meeres und der Erde werden im Hightechverfahren harmonisiert f&uuml;r ein unglaubliches sichtbares Resultat und ein un&uuml;bertroffenes SPA Erlebnis.</p>\r\n<p><strong>Behandlungseffizienz</strong>&nbsp;durch hochqualifizierte und ausgebildete Kosmetikerinnen. Gesichts- und K&ouml;rperbehandlungen sind speziell auf jeden Hauttyp abgestimmt. Die Behandlung im Studio wird durch die Produkte f&uuml;r zu Hause abgerundet.<em>&nbsp;</em></p>\r\n<p><strong><em>\"Eine Affinit&auml;t zur Natur...\"</em></strong>&nbsp;Pevonia h&auml;lt eine harmonische Balance zu den wertvollsten Rohstoffen. Die Verpackungen sind komplett biologisch abbaubar und auf Tierversuche wird in jeglicher Form verzichtet.</p>', null);
INSERT INTO `module_cms_detail_1` VALUES ('111', '29', '1', 'Pevonia Botanica', 'pevonia-logo.png', '<p><strong><strong>Pevonia Botanica</strong>&nbsp;</strong>ist eine SPA Pflegelinie, augew&auml;hlt von den sch&ouml;nsten und bekanntesten SPA\'s und Kosmetikinstituten weltweit. Pevonia bietet &uuml;ber 150 spezielle Heimbehandlungen und mehr als 100 professionelle Behandlungen an. Die effektive Pflege f&uuml;r Sie und Ihn jeden Hauttyps.</p>\r\n<p><strong><img src=\"/resource/module-cms-1/tinymce/pevonia_header.jpg\" alt=\"\" /></strong></p>\r\n<p><strong>Das Beste des Meeres und der Erde...</strong>&nbsp;Die reinsten, nat&uuml;rlichen Elemente des Meeres und der Erde werden im Hightechverfahren harmonisiert f&uuml;r ein unglaubliches sichtbares Resultat und ein un&uuml;bertroffenes SPA Erlebnis.</p>\r\n<p><strong>Behandlungseffizienz</strong>&nbsp;durch hochqualifizierte und ausgebildete Kosmetikerinnen. Gesichts- und K&ouml;rperbehandlungen sind speziell auf jeden Hauttyp abgestimmt. Die Behandlung im Studio wird durch die Produkte f&uuml;r zu Hause abgerundet.<em>&nbsp;</em></p>\r\n<p><strong><em>\"Eine Affinit&auml;t zur Natur...\"</em></strong>&nbsp;Pevonia h&auml;lt eine harmonische Balance zu den wertvollsten Rohstoffen. Die Verpackungen sind komplett biologisch abbaubar und auf Tierversuche wird in jeglicher Form verzichtet.</p>', null);
