INSERT INTO `module_cms_detail_2` VALUES ('33', '9', '3', 'Scirus Information', '', '<p><a name=\"why\"></a><strong>Why Use Scirus?</strong></p>\r\n<p>Search engines are all different in the Web sites they cover, and the way they classify these Web sites. Scirus, the search engine for science, focuses only on Web pages containing scientific content.</p>\r\n<p>Searching more than 545 million science-related pages, Scirus helps you quickly locate scientific information on the Web:</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"left\" valign=\"top\" width=\"20\">&bull;</td>\r\n<td><strong>Filters</strong>&nbsp;out non-scientific sites. For example, if you search on REM, Google finds the rock group - Scirus finds information on sleep, among other things</td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\" width=\"20\">&bull;</td>\r\n<td><strong>Finds&nbsp;</strong>peer-reviewed articles such as PDF and PostScript files, which are often invisible to other search engines.</td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\" width=\"20\">&bull;</td>\r\n<td><strong>Searches</strong>&nbsp;the most comprehensive combination of web information, preprint servers, digital archives, repositories and patent and journal databases. Scirus goes deeper than the first two levels of a Web site, thereby revealing much more relevant information.</td>\r\n</tr>\r\n</tbody>\r\n</table>', null);
