INSERT INTO `module_cms_detail_2` VALUES ('114', '30', '1', 'Europe', 'Europe_1.jpg', '<p>Europe</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Europe</strong>&nbsp;(<span class=\"nowrap\"><span class=\"noexcerpt\"><a title=\"Listen\" href=\"http://upload.wikimedia.org/wikipedia/commons/4/46/En-us-Europe.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png\" alt=\"Listen\" width=\"11\" height=\"11\" /></a><sup><span class=\"IPA\"><a title=\"File:En-us-Europe.ogg\" href=\"http://en.wikipedia.org/wiki/File:En-us-Europe.ogg\">i</a></span></sup></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/jÊŠÉ™r/ \'ure\' in \'cure\'\">jÊŠÉ™r</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É™/ \'a\' in \'about\'\">É™</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'p\' in \'pie\'\">p</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;<span class=\"Unicode\" title=\"English pronunciation respelling\"><a title=\"Wikipedia:Pronunciation respelling key\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Pronunciation_respelling_key\"><em><strong><span class=\"smallcaps\"><span class=\"SMALLCAPS\"><span class=\"NOCAPS\">ewr</span></span></span></strong>-É™p</em></a></span>&nbsp;or&nbsp;<span class=\"nowrap\"><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/j/ \'y\' in \'yes\'\">j</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Éœr/ \'ir\' in \'bird\'\">Éœr</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É™/ \'a\' in \'about\'\">É™</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'p\' in \'pie\'\">p</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;<span class=\"Unicode\" title=\"English pronunciation respelling\"><a title=\"Wikipedia:Pronunciation respelling key\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Pronunciation_respelling_key\"><em><strong><span class=\"smallcaps\"><span class=\"SMALLCAPS\"><span class=\"NOCAPS\">yur</span></span></span></strong>-É™p</em></a></span><sup id=\"cite_ref-1\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Europe#cite_note-1\">[1]</a></sup>) is, by convention, one of the world\'s seven&nbsp;<a title=\"Continent\" href=\"http://en.wikipedia.org/wiki/Continent\">continents</a>. Comprising the westernmost&nbsp;<a title=\"Peninsula\" href=\"http://en.wikipedia.org/wiki/Peninsula\">peninsula</a>&nbsp;of&nbsp;<a title=\"Eurasia\" href=\"http://en.wikipedia.org/wiki/Eurasia\">Eurasia</a>, Europe is generally&nbsp;<a class=\"mw-redirect\" title=\"Borders of the continents\" href=\"http://en.wikipedia.org/wiki/Borders_of_the_continents#Europe_and_Asia\">divided from Asia</a>&nbsp;by the&nbsp;<a title=\"Drainage divide\" href=\"http://en.wikipedia.org/wiki/Drainage_divide\">watershed divides</a>&nbsp;of the&nbsp;<a title=\"Ural Mountains\" href=\"http://en.wikipedia.org/wiki/Ural_Mountains\">Ural</a>&nbsp;and&nbsp;<a title=\"Caucasus Mountains\" href=\"http://en.wikipedia.org/wiki/Caucasus_Mountains\">Caucasus</a>Mountains, the&nbsp;<a title=\"Ural River\" href=\"http://en.wikipedia.org/wiki/Ural_River\">Ural River</a>, the&nbsp;<a title=\"Caspian Sea\" href=\"http://en.wikipedia.org/wiki/Caspian_Sea\">Caspian</a>&nbsp;and&nbsp;<a title=\"Black Sea\" href=\"http://en.wikipedia.org/wiki/Black_Sea\">Black</a>&nbsp;Seas, and the&nbsp;<a class=\"mw-redirect\" title=\"Bosporus\" href=\"http://en.wikipedia.org/wiki/Bosporus\">waterways</a>&nbsp;connecting the&nbsp;<a title=\"Black Sea\" href=\"http://en.wikipedia.org/wiki/Black_Sea\">Black</a>&nbsp;and&nbsp;<a title=\"Aegean Sea\" href=\"http://en.wikipedia.org/wiki/Aegean_Sea\">Aegean</a>&nbsp;Seas.<sup id=\"cite_ref-NatlGeoAtlas_2-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Europe#cite_note-NatlGeoAtlas-2\">[2]</a></sup></p>\r\n<p>Europe is bordered by the&nbsp;<a title=\"Arctic Ocean\" href=\"http://en.wikipedia.org/wiki/Arctic_Ocean\">Arctic Ocean</a>&nbsp;to the north, the&nbsp;<a title=\"Atlantic Ocean\" href=\"http://en.wikipedia.org/wiki/Atlantic_Ocean\">Atlantic Ocean</a>&nbsp;to the west, the&nbsp;<a title=\"Mediterranean Sea\" href=\"http://en.wikipedia.org/wiki/Mediterranean_Sea\">Mediterranean Sea</a>&nbsp;to the south, and the Black Sea and connected waterways to the southeast. Yet the borders of Europe&mdash;a concept dating back to&nbsp;<a title=\"Classical antiquity\" href=\"http://en.wikipedia.org/wiki/Classical_antiquity\">classical antiquity</a>&mdash;are somewhat arbitrary, as the primarily&nbsp;<a title=\"Physical geography\" href=\"http://en.wikipedia.org/wiki/Physical_geography\">physiographic</a>&nbsp;term \"continent\" can incorporate&nbsp;<a title=\"Human geography\" href=\"http://en.wikipedia.org/wiki/Human_geography\">cultural and political</a>&nbsp;elements.</p>\r\n<p>Europe is the world\'s&nbsp;<a class=\"mw-redirect\" title=\"List of continents\" href=\"http://en.wikipedia.org/wiki/List_of_continents\">second-smallest</a>&nbsp;continent by surface area, covering about 10,180,000 square kilometres (3,930,000&nbsp;sq&nbsp;mi) or 2% of the Earth\'s surface and about 6.8% of its land area. Of Europe\'s approximately 50 states,&nbsp;<a title=\"Russia\" href=\"http://en.wikipedia.org/wiki/Russia\">Russia</a>&nbsp;is by far the largest by both area and population, taking up 40% of the continent (although the country has territory in both Europe and Asia), while&nbsp;<a title=\"Vatican City\" href=\"http://en.wikipedia.org/wiki/Vatican_City\">Vatican City</a>&nbsp;is the smallest. Europe is the third-most populous continent after&nbsp;<a title=\"Asia\" href=\"http://en.wikipedia.org/wiki/Asia\">Asia</a>&nbsp;and&nbsp;<a title=\"Africa\" href=\"http://en.wikipedia.org/wiki/Africa\">Africa</a>, with a&nbsp;<a title=\"Demographics of Europe\" href=\"http://en.wikipedia.org/wiki/Demographics_of_Europe\">population</a>&nbsp;of 733&nbsp;million or about 11% of the&nbsp;<a title=\"World population\" href=\"http://en.wikipedia.org/wiki/World_population\">world\'s population</a>.<sup id=\"cite_ref-3\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Europe#cite_note-3\">[3]</a></sup></p>\r\n<p>Europe, in particular&nbsp;<a title=\"Ancient Greece\" href=\"http://en.wikipedia.org/wiki/Ancient_Greece\">Ancient Greece</a>, is the birthplace of&nbsp;<a title=\"Western culture\" href=\"http://en.wikipedia.org/wiki/Western_culture\">Western culture</a>.<sup id=\"cite_ref-4\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Europe#cite_note-4\">[4]</a></sup>&nbsp;It played a predominant role in global affairs from the 15th century onwards, especially after the beginning of&nbsp;<a title=\"Colonialism\" href=\"http://en.wikipedia.org/wiki/Colonialism\">colonialism</a>. Between the 16th and 20th centuries, European nations controlled at various times&nbsp;<a class=\"mw-redirect\" title=\"European colonisation of the Americas\" href=\"http://en.wikipedia.org/wiki/European_colonisation_of_the_Americas\">the Americas</a>,&nbsp;<a title=\"Colonisation of Africa\" href=\"http://en.wikipedia.org/wiki/Colonisation_of_Africa\">most of Africa</a>,&nbsp;<a title=\"Oceania\" href=\"http://en.wikipedia.org/wiki/Oceania\">Oceania</a>, and large portions of Asia. In 1900, Europe\'s share of the world\'s population was 25%.<sup id=\"cite_ref-World_Population_Growth.2C_1950.E2.80.932050_5-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Europe#cite_note-World_Population_Growth.2C_1950.E2.80.932050-5\">[5]</a></sup></p>\r\n<p>Both&nbsp;<a title=\"World war\" href=\"http://en.wikipedia.org/wiki/World_war\">World Wars</a>&nbsp;were largely focused upon Europe, greatly contributing to a decline in<a title=\"Western Europe\" href=\"http://en.wikipedia.org/wiki/Western_Europe\">Western European</a>&nbsp;dominance in world affairs by the mid-20th century as the&nbsp;<a title=\"United States\" href=\"http://en.wikipedia.org/wiki/United_States\">United States</a>&nbsp;and&nbsp;<a title=\"Soviet Union\" href=\"http://en.wikipedia.org/wiki/Soviet_Union\">Soviet Union</a>&nbsp;took prominence.<sup id=\"cite_ref-natgeo_534_6-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Europe#cite_note-natgeo_534-6\">[6]</a></sup>&nbsp;During the&nbsp;<a title=\"Cold War\" href=\"http://en.wikipedia.org/wiki/Cold_War\">Cold War</a>, Europe was divided along the&nbsp;<a title=\"Iron Curtain\" href=\"http://en.wikipedia.org/wiki/Iron_Curtain\">Iron Curtain</a>&nbsp;between&nbsp;<a title=\"NATO\" href=\"http://en.wikipedia.org/wiki/NATO\">NATO</a>&nbsp;in the west and the&nbsp;<a title=\"Warsaw Pact\" href=\"http://en.wikipedia.org/wiki/Warsaw_Pact\">Warsaw Pact</a>&nbsp;in the east.<a title=\"European integration\" href=\"http://en.wikipedia.org/wiki/European_integration\">European integration</a>&nbsp;led to the formation of the&nbsp;<a title=\"Council of Europe\" href=\"http://en.wikipedia.org/wiki/Council_of_Europe\">Council of Europe</a>&nbsp;and the&nbsp;<a title=\"European Union\" href=\"http://en.wikipedia.org/wiki/European_Union\">European Union</a>&nbsp;in Western Europe, both of which have been expanding eastward since the&nbsp;<a title=\"Revolutions of 1989\" href=\"http://en.wikipedia.org/wiki/Revolutions_of_1989\">revolutions of 1989</a>&nbsp;and the&nbsp;<a title=\"Dissolution of the Soviet Union\" href=\"http://en.wikipedia.org/wiki/Dissolution_of_the_Soviet_Union\">fall of the Soviet Union</a>&nbsp;in 1991.</p>', null);
