INSERT INTO `module_cms_detail_2` VALUES ('122', '32', '1', 'India', 'india_1.jpg', '<p>India</p>\r\n<p>&nbsp;</p>\r\n<p><strong>India</strong>&nbsp;(<span class=\"nowrap\"><span class=\"noexcerpt\"><a title=\"Listen\" href=\"http://upload.wikimedia.org/wikipedia/commons/6/67/En-us-India.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png\" alt=\"Listen\" width=\"11\" height=\"11\" /></a><sup><span class=\"IPA\"><a title=\"File:En-us-India.ogg\" href=\"http://en.wikipedia.org/wiki/File:En-us-India.ogg\">i</a></span></sup></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Éª/ short \'i\' in \'bid\'\">Éª</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'d\' in \'dye\'\">d</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/i/ \'y\' in \'happy\'\">i</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É™/ \'a\' in \'about\'\">É™</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>), officially the&nbsp;<strong>Republic of India</strong>&nbsp;(<em><strong><span lang=\"inc-Latn\">Bharat Ganrajya</span></strong></em>)<sup id=\"cite_ref-12\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/India#cite_note-12\">[c]</a></sup>, is a country in&nbsp;<a title=\"South Asia\" href=\"http://en.wikipedia.org/wiki/South_Asia\">South Asia</a>. It is the&nbsp;<a class=\"mw-redirect\" title=\"List of countries and outlying territories by total area\" href=\"http://en.wikipedia.org/wiki/List_of_countries_and_outlying_territories_by_total_area\">seventh-largest</a>&nbsp;country by area, the&nbsp;<a title=\"List of countries by population\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_population\">second-most populous</a>country with&nbsp;<a title=\"Demographics of India\" href=\"http://en.wikipedia.org/wiki/Demographics_of_India\">over 1.2 billion people</a>, and the most populous&nbsp;<a title=\"Democracy\" href=\"http://en.wikipedia.org/wiki/Democracy\">democracy</a>&nbsp;in the world. Bounded by the&nbsp;<a title=\"Indian Ocean\" href=\"http://en.wikipedia.org/wiki/Indian_Ocean\">Indian Ocean</a>&nbsp;on the south, the&nbsp;<a title=\"Arabian Sea\" href=\"http://en.wikipedia.org/wiki/Arabian_Sea\">Arabian Sea</a>&nbsp;on the south-west, and the<a title=\"Bay of Bengal\" href=\"http://en.wikipedia.org/wiki/Bay_of_Bengal\">Bay of Bengal</a>&nbsp;on the south-east, it shares land borders with&nbsp;<a title=\"Pakistan\" href=\"http://en.wikipedia.org/wiki/Pakistan\">Pakistan</a>&nbsp;to the west;<sup id=\"cite_ref-13\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/India#cite_note-13\">[d]</a></sup><a title=\"China\" href=\"http://en.wikipedia.org/wiki/China\">China</a>,&nbsp;<a title=\"Nepal\" href=\"http://en.wikipedia.org/wiki/Nepal\">Nepal</a>, and&nbsp;<a title=\"Bhutan\" href=\"http://en.wikipedia.org/wiki/Bhutan\">Bhutan</a>&nbsp;to the north-east; and&nbsp;<a title=\"Burma\" href=\"http://en.wikipedia.org/wiki/Burma\">Burma</a>&nbsp;and&nbsp;<a title=\"Bangladesh\" href=\"http://en.wikipedia.org/wiki/Bangladesh\">Bangladesh</a>&nbsp;to the east. In the Indian Ocean, India is in the vicinity of&nbsp;<a title=\"Sri Lanka\" href=\"http://en.wikipedia.org/wiki/Sri_Lanka\">Sri Lanka</a>&nbsp;and the&nbsp;<a title=\"Maldives\" href=\"http://en.wikipedia.org/wiki/Maldives\">Maldives</a>; in addition, India\'s&nbsp;<a title=\"Andaman and Nicobar Islands\" href=\"http://en.wikipedia.org/wiki/Andaman_and_Nicobar_Islands\">Andaman and Nicobar Islands</a>&nbsp;share a maritime border with&nbsp;<a title=\"Thailand\" href=\"http://en.wikipedia.org/wiki/Thailand\">Thailand</a>&nbsp;and<a title=\"Indonesia\" href=\"http://en.wikipedia.org/wiki/Indonesia\">Indonesia</a>.</p>\r\n<p>Home to the ancient&nbsp;<a class=\"mw-redirect\" title=\"Indus Valley Civilisation\" href=\"http://en.wikipedia.org/wiki/Indus_Valley_Civilisation\">Indus Valley Civilisation</a>&nbsp;and a region of historic trade routes and vast empires, the&nbsp;<a title=\"Indian subcontinent\" href=\"http://en.wikipedia.org/wiki/Indian_subcontinent\">Indian subcontinent</a>&nbsp;was identified with its commercial and cultural wealth for much of its long history.<sup id=\"cite_ref-FOOTNOTEStein199816.E2.80.9317_14-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/India#cite_note-FOOTNOTEStein199816.E2.80.9317-14\">[10]</a></sup>&nbsp;Four world religions&mdash;<a title=\"Hinduism in India\" href=\"http://en.wikipedia.org/wiki/Hinduism_in_India\">Hinduism</a>,&nbsp;<a title=\"History of Buddhism in India\" href=\"http://en.wikipedia.org/wiki/History_of_Buddhism_in_India\">Buddhism</a>,<a class=\"mw-redirect\" title=\"Statistics of Jainism\" href=\"http://en.wikipedia.org/wiki/Statistics_of_Jainism\">Jainism</a>, and&nbsp;<a title=\"Sikhism in India\" href=\"http://en.wikipedia.org/wiki/Sikhism_in_India\">Sikhism</a>&mdash;originated here, whereas&nbsp;<a title=\"Parsi\" href=\"http://en.wikipedia.org/wiki/Parsi\">Zoroastrianism</a>,&nbsp;<a title=\"Christianity in India\" href=\"http://en.wikipedia.org/wiki/Christianity_in_India\">Christianity</a>, and&nbsp;<a title=\"Islam in India\" href=\"http://en.wikipedia.org/wiki/Islam_in_India\">Islam</a>arrived in the 1st millennium&nbsp;<a title=\"Common Era\" href=\"http://en.wikipedia.org/wiki/Common_Era\">CE</a>&nbsp;and also helped shape the region\'s&nbsp;<a class=\"mw-redirect\" title=\"Indian culture\" href=\"http://en.wikipedia.org/wiki/Indian_culture\">diverse culture</a>. Gradually annexed by and brought under the administration of the&nbsp;<a title=\"Company rule in India\" href=\"http://en.wikipedia.org/wiki/Company_rule_in_India\">British East India Company</a>&nbsp;from the early 18th century and&nbsp;<a title=\"British Raj\" href=\"http://en.wikipedia.org/wiki/British_Raj\">administered directly by the United Kingdom</a>from the mid-19th century, India became an independent nation in 1947 after a&nbsp;<a title=\"Indian independence movement\" href=\"http://en.wikipedia.org/wiki/Indian_independence_movement\">struggle for independence</a>&nbsp;that was marked by&nbsp;<a class=\"mw-redirect\" title=\"Non-violent resistance\" href=\"http://en.wikipedia.org/wiki/Non-violent_resistance\">non-violent resistance</a>&nbsp;led by&nbsp;<a class=\"mw-redirect\" title=\"Mohandas Karamchand Gandhi\" href=\"http://en.wikipedia.org/wiki/Mohandas_Karamchand_Gandhi\">Mahatma Gandhi</a>.</p>\r\n<p>The&nbsp;<a title=\"Economy of India\" href=\"http://en.wikipedia.org/wiki/Economy_of_India\">Indian economy</a>&nbsp;is the world\'s tenth-largest by&nbsp;<a title=\"List of countries by GDP (nominal)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(nominal)\">nominal GDP</a>&nbsp;and third-largest by<a title=\"List of countries by GDP (PPP)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(PPP)\">purchasing power parity</a>&nbsp;(PPP).<sup id=\"cite_ref-WBD_9-1\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/India#cite_note-WBD-9\">[7]</a></sup>&nbsp;Following&nbsp;<a title=\"Economic liberalisation in India\" href=\"http://en.wikipedia.org/wiki/Economic_liberalisation_in_India\">market-based economic reforms</a>&nbsp;in 1991, India became one of the&nbsp;<a title=\"List of countries by real GDP growth rate (latest year)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_real_GDP_growth_rate_(latest_year)\">fastest-growing major economies</a>; it is considered a&nbsp;<a class=\"mw-redirect\" title=\"Newly industrialised country\" href=\"http://en.wikipedia.org/wiki/Newly_industrialised_country\">newly industrialised country</a>. However, it continues to face the challenges of&nbsp;<a title=\"Poverty in India\" href=\"http://en.wikipedia.org/wiki/Poverty_in_India\">poverty</a>,&nbsp;<a title=\"Literacy in India\" href=\"http://en.wikipedia.org/wiki/Literacy_in_India\">illiteracy</a>,<a title=\"Corruption in India\" href=\"http://en.wikipedia.org/wiki/Corruption_in_India\">corruption</a>,&nbsp;<a title=\"Malnutrition in India\" href=\"http://en.wikipedia.org/wiki/Malnutrition_in_India\">malnutrition</a>,&nbsp;<a title=\"Healthcare in India\" href=\"http://en.wikipedia.org/wiki/Healthcare_in_India\">inadequate public healthcare</a>, and&nbsp;<a title=\"Terrorism in India\" href=\"http://en.wikipedia.org/wiki/Terrorism_in_India\">terrorism</a>. A&nbsp;<a class=\"mw-redirect\" title=\"Nuclear weapons state\" href=\"http://en.wikipedia.org/wiki/Nuclear_weapons_state\">nuclear weapons state</a>&nbsp;and a&nbsp;<a title=\"Power (international relations)\" href=\"http://en.wikipedia.org/wiki/Power_(international_relations)#Power_as_status\">regional power</a>, it has the&nbsp;<a class=\"mw-redirect\" title=\"List of countries by number of troops\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_number_of_troops\">third-largest standing army</a>&nbsp;in the world and ranks<a title=\"List of countries by military expenditures\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_military_expenditures\">seventh in military expenditure</a>&nbsp;among nations. India is a&nbsp;<a title=\"Federalism\" href=\"http://en.wikipedia.org/wiki/Federalism\">federal</a>&nbsp;<a class=\"mw-redirect\" title=\"Constitutional republic\" href=\"http://en.wikipedia.org/wiki/Constitutional_republic\">constitutional republic</a>governed under a&nbsp;<a title=\"Parliamentary system\" href=\"http://en.wikipedia.org/wiki/Parliamentary_system\">parliamentary system</a>&nbsp;consisting of&nbsp;<a title=\"States and territories of India\" href=\"http://en.wikipedia.org/wiki/States_and_territories_of_India\">28 states and 7 union territories</a>. India is a pluralistic,&nbsp;<a title=\"Languages of India\" href=\"http://en.wikipedia.org/wiki/Languages_of_India\">multilingual</a>, and&nbsp;<a title=\"Culture of India\" href=\"http://en.wikipedia.org/wiki/Culture_of_India\">multiethnic society</a>. It is also home to a diversity of&nbsp;<a title=\"Wildlife of India\" href=\"http://en.wikipedia.org/wiki/Wildlife_of_India\">wildlife</a>&nbsp;in a variety of&nbsp;<a title=\"Protected areas of India\" href=\"http://en.wikipedia.org/wiki/Protected_areas_of_India\">protected habitats</a>.</p>', null);
