=\"\'t\' in \'tie\'\">t</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/&aelig;/ short \'a\' in \'bad\'\">&aelig;</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;or&nbsp;<span class=\"nowrap\"><span class=\"noexcerpt\"><a title=\"Listen\" href=\"http://upload.wikimedia.org/wikipedia/commons/9/9f/En-us-Pakistan-2.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png\" alt=\"Listen\" width=\"11\" height=\"11\" /></a><sup><span class=\"IPA\"><a title=\"File:En-us-Pakistan-2.ogg\" href=\"http://en.wikipedia.org/wiki/File:En-us-Pakistan-2.ogg\">i</a></span></sup></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'p\' in \'pie\'\">p</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É‘Ë/ \'a\' in \'father\'\">É‘Ë</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'k\' in \'kind\'\">k</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/i/ \'y\' in \'happy\'\">i</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'t\' in \'tie\'\">t</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É‘Ë/ \'a\' in \'father\'\">É‘Ë</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>;&nbsp;<a title=\"Urdu\" href=\"http://en.wikipedia.org/wiki/Urdu\">Urdu</a>:&nbsp;<span lang=\"ur\"><span title=\"Nasta\'liq\" lang=\"und-Arab\"><span><a class=\"extiw\" title=\"wikt:Ù¾Ø§ÙƒÙØ³ØªØ§Ù†\" href=\"http://en.wiktionary.org/wiki/%D9%BE%D8%A7%D9%83%D9%90%D8%B3%D8%AA%D8%A7%D9%86\">Ù¾Ø§ÙƒÙØ³ØªØ§Ù†</a></span></span></span>&lrm;) (<small>Urdu pronunciation:&nbsp;</small><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for Hindi and Urdu\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_Hindi_and_Urdu\">[paËkÉªËˆstÌªaËn]</a></span><small class=\"nowrap\">&nbsp;(<a title=\"File:Pakistan pronunciation.ogg\" href=\"http://en.wikipedia.org/wiki/File:Pakistan_pronunciation.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/2/21/Speaker_Icon.svg/13px-Speaker_Icon.svg.png\" alt=\"\" width=\"13\" height=\"13\" /></a>&nbsp;<a class=\"internal\" title=\"Pakistan pronunciation.ogg\" href=\"http://upload.wikimedia.org/wikipedia/en/d/d8/Pakistan_pronunciation.ogg\">listen</a>)</small>), officially the&nbsp;<strong>Islamic Republic of Pakistan</strong>(<a title=\"Urdu\" href=\"http://en.wikipedia.org/wiki/Urdu\">Urdu</a>:&nbsp;<span lang=\"ur\"><span title=\"Nasta\'liq\" lang=\"und-Arab\"><span>Ø§Ø³Ù„Ø§Ù…ÛŒ Ø¬Ù…ÛÙˆØ±ÛŒÛ‚ Ù¾Ø§ÙƒÙØ³ØªØ§Ù†</span></span></span>&lrm;), is a sovereign country in&nbsp;<a title=\"South Asia\" href=\"http://en.wikipedia.org/wiki/South_Asia\">South Asia</a>. With a population exceeding&nbsp;<a title=\"Demographics of Pakistan\" href=\"http://en.wikipedia.org/wiki/Demographics_of_Pakistan\">180 million people</a>, it is the sixth&nbsp;<a title=\"List of countries by population\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_population\">most populous</a>&nbsp;country in the world. Located at the crossroads of the strategically important regions of South Asia, Central Asia and Western Asia, Pakistan has a 1,046-kilometre (650&nbsp;mi) coastline along the&nbsp;<a title=\"Arabian Sea\" href=\"http://en.wikipedia.org/wiki/Arabian_Sea\">Arabian Sea</a>&nbsp;and the&nbsp;<a title=\"Gulf of Oman\" href=\"http://en.wikipedia.org/wiki/Gulf_of_Oman\">Gulf of Oman</a>&nbsp;in the south and is bordered by&nbsp;<a title=\"India\" href=\"http://en.wikipedia.org/wiki/India\">India</a>&nbsp;to the east,&nbsp;<a title=\"Afghanistan\" href=\"http://en.wikipedia.org/wiki/Afghanistan\">Afghanistan</a>&nbsp;to the west and north,&nbsp;<a title=\"Iran\" href=\"http://en.wikipedia.org/wiki/Iran\">Iran</a>&nbsp;to the southwest and&nbsp;<a title=\"China\" href=\"http://en.wikipedia.org/wiki/China\">China</a>&nbsp;in the far northeast. It is separated from&nbsp;<a title=\"Tajikistan\" href=\"http://en.wikipedia.org/wiki/Tajikistan\">Tajikistan</a>&nbsp;by Afghanistan\'s narrow&nbsp;<a title=\"Wakhan Corridor\" href=\"http://en.wikipedia.org/wiki/Wakhan_Corridor\">Wakhan Corridor</a>in the north, and also shares a&nbsp;<a class=\"mw-redirect\" title=\"Marine border\" href=\"http://en.wikipedia.org/wiki/Marine_border\">marine border</a>&nbsp;with&nbsp;<a title=\"Oman\" href=\"http://en.wikipedia.org/wiki/Oman\">Oman</a>.</p>\r\n<p>The territory of modern Pakistan was home to several ancient cultures, including the Neolithic&nbsp;<a title=\"Mehrgarh\" href=\"http://en.wikipedia.org/wiki/Mehrgarh\">Mehrgarh</a>&nbsp;and the Bronze Age&nbsp;<a class=\"mw-redirect\" title=\"Indus Valley Civilisation\" href=\"http://en.wikipedia.org/wiki/Indus_Valley_Civilisation\">Indus Valley Civilisation</a>, and has undergone invasions or settlements by&nbsp;<a title=\"Hindu\" href=\"http://en.wikipedia.org/wiki/Hindu\">Hindu</a>,&nbsp;<a title=\"Iranian peoples\" href=\"http://en.wikipedia.org/wiki/Iranian_peoples\">Persian</a>,&nbsp;<a class=\"mw-redirect\" title=\"Indo-Greek\" href=\"http://en.wikipedia.org/wiki/Indo-Greek\">Indo-Greek</a>,&nbsp;<a title=\"Muslim conquest in the Indian subcontinent\" href=\"http://en.wikipedia.org/wiki/Muslim_conquest_in_the_Indian_subcontinent\">Islamic</a>,&nbsp;<a title=\"Timurid dynasty\" href=\"http://en.wikipedia.org/wiki/Timurid_dynasty\">Turco-Mongol</a>,<a title=\"Afghan (ethnonym)\" href=\"http://en.wikipedia.org/wiki/Afghan_(ethnonym)\">Afghan</a>&nbsp;and&nbsp;<a title=\"Sikh\" href=\"http://en.wikipedia.org/wiki/Sikh\">Sikh</a>&nbsp;cultures. The area has been ruled by numerous empires and dynasties, including the Indian&nbsp;<a class=\"mw-redirect\" title=\"Mauryan Empire\" href=\"http://en.wikipedia.org/wiki/Mauryan_Empire\">Mauryan Empire</a>, the Persian&nbsp;<a title=\"Achaemenid Empire\" href=\"http://en.wikipedia.org/wiki/Achaemenid_Empire\">Achaemenid Empire</a>, the Arab&nbsp;<a title=\"Umayyad Caliphate\" href=\"http://en.wikipedia.org/wiki/Umayyad_Caliphate\">Umayyad Caliphate</a>, the&nbsp;<a title=\"Mongol Empire\" href=\"http://en.wikipedia.org/wiki/Mongol_Empire\">Mongol Empire</a>, the&nbsp;<a title=\"Mughal Empire\" href=\"http://en.wikipedia.org/wiki/Mughal_Empire\">Mughal Empire</a>, the&nbsp;<a title=\"Durrani Empire\" href=\"http://en.wikipedia.org/wiki/Durrani_Empire\">Durrani Empire</a>, the&nbsp;<a title=\"Sikh Empire\" href=\"http://en.wikipedia.org/wiki/Sikh_Empire\">Sikh Empire</a>&nbsp;and the&nbsp;<a title=\"British Raj\" href=\"http://en.wikipedia.org/wiki/British_Raj\">British Empire</a>. As a result of the&nbsp;<a title=\"Pakistan Movement\" href=\"http://en.wikipedia.org/wiki/Pakistan_Movement\">Pakistan Movement</a>&nbsp;led by&nbsp;<a title=\"Muhammad Ali Jinnah\" href=\"http://en.wikipedia.org/wiki/Muhammad_Ali_Jinnah\">Muhammad Ali Jinnah</a>&nbsp;and&nbsp;<a title=\"Indian independence movement\" href=\"http://en.wikipedia.org/wiki/Indian_independence_movement\">India\'s struggle for independence</a>, Pakistan was&nbsp;<a title=\"Indian Independence Act 1947\" href=\"http://en.wikipedia.org/wiki/Indian_Independence_Act_1947\">created in 1947</a>&nbsp;as an independent nation for Muslims from the regions in the east and west of India where there was a Muslim majority. Initially a&nbsp;<a title=\"Dominion of Pakistan\" href=\"http://en.wikipedia.org/wiki/Dominion_of_Pakistan\">dominion</a>, Pakistan adopted a&nbsp;<a title=\"Constitution of Pakistan\" href=\"http://en.wikipedia.org/wiki/Constitution_of_Pakistan\">new constitution</a>&nbsp;in 1956, becoming an&nbsp;<a title=\"Islamic republic\" href=\"http://en.wikipedia.org/wiki/Islamic_republic\">Islamic republic</a>. A&nbsp;<a title=\"Bangladesh Liberation War\" href=\"http://en.wikipedia.org/wiki/Bangladesh_Liberation_War\">civil war</a>&nbsp;in 1971 resulted in the secession of&nbsp;<a title=\"East Pakistan\" href=\"http://en.wikipedia.org/wiki/East_Pakistan\">East Pakistan</a>&nbsp;as the new country of<a title=\"Bangladesh\" href=\"http://en.wikipedia.org/wiki/Bangladesh\">Bangladesh</a>.</p>\r\n<p>Pakistan is a&nbsp;<a title=\"Federation\" href=\"http://en.wikipedia.org/wiki/Federation\">federal</a>&nbsp;<a title=\"Parliamentary republic\" href=\"http://en.wikipedia.org/wiki/Parliamentary_republic\">parliamentary republic</a>&nbsp;consisting of&nbsp;<a title=\"Administrative units of Pakistan\" href=\"http://en.wikipedia.org/wiki/Administrative_units_of_Pakistan\">four provinces and four federal territories</a>. It is an&nbsp;<a title=\"Ethnic groups in Pakistan\" href=\"http://en.wikipedia.org/wiki/Ethnic_groups_in_Pakistan\">ethnically</a>&nbsp;and&nbsp;<a title=\"Languages of Pakistan\" href=\"http://en.wikipedia.org/wiki/Languages_of_Pakistan\">linguistically</a>&nbsp;diverse country, with a similar variation in its&nbsp;<a title=\"Geography of Pakistan\" href=\"http://en.wikipedia.org/wiki/Geography_of_Pakistan\">geography</a>&nbsp;and&nbsp;<a title=\"Fauna of Pakistan\" href=\"http://en.wikipedia.org/wiki/Fauna_of_Pakistan\">wildlife</a>. A&nbsp;<a title=\"Regional power\" href=\"http://en.wikipedia.org/wiki/Regional_power\">regional</a>&nbsp;and&nbsp;<a title=\"Middle power\" href=\"http://en.wikipedia.org/wiki/Middle_power\">middle power</a>,<sup id=\"cite_ref-Buzan2004_11-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Pakistan#cite_note-Buzan2004-11\">[10]</a></sup><sup id=\"cite_ref-Solomon_12-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Pakistan#cite_note-Solomon-12\">[11]</a></sup>&nbsp;Pakistan has the&nbsp;<a class=\"mw-redirect\" title=\"List of countries by number of troops\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_number_of_troops\">seventh largest standing armed forces</a>&nbsp;in the world and is also a&nbsp;<a title=\"Nuclear power in Pakistan\" href=\"http://en.wikipedia.org/wiki/Nuclear_power_in_Pakistan\">nuclear power</a>&nbsp;as well as a declared&nbsp;<a title=\"List of states with nuclear weapons\" href=\"http://en.wikipedia.org/wiki/List_of_states_with_nuclear_weapons\">nuclear weapons</a>&nbsp;state, being the only nation in the<a title=\"Muslim world\" href=\"http://en.wikipedia.org/wiki/Muslim_world\">Muslim world</a>, and the second in South Asia, to have that status. It has a semi-industrialised&nbsp;<a title=\"Economy of Pakistan\" href=\"http://en.wikipedia.org/wiki/Economy_of_Pakistan\">economy</a>&nbsp;which is the&nbsp;<a title=\"List of countries by GDP (PPP)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(PPP)\">27th largest</a>&nbsp;in the world in terms of purchasing power and&nbsp;<a title=\"List of countries by GDP (nominal)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(nominal)\">47th largest</a>&nbsp;in terms of nominal GDP.</p>\r\n<p>Pakistan\'s post-independence history has been characterised by periods of military rule, political instability and&nbsp;<a title=\"Indo-Pakistani wars and conflicts\" href=\"http://en.wikipedia.org/wiki/Indo-Pakistani_wars_and_conflicts\">conflicts with neighbouring India</a>. The country continues to face challenging problems, including&nbsp;<a title=\"Terrorism in Pakistan\" href=\"http://en.wikipedia.org/wiki/Terrorism_in_Pakistan\">terrorism</a>,&nbsp;<a title=\"Poverty in Pakistan\" href=\"http://en.wikipedia.org/wiki/Poverty_in_Pakistan\">poverty</a>,&nbsp;<a title=\"Education in Pakistan\" href=\"http://en.wikipedia.org/wiki/Education_in_Pakistan#Literacy_rate\">illiteracy</a>&nbsp;and&nbsp;<a title=\"Corruption in Pakistan\" href=\"http://en.wikipedia.org/wiki/Corruption_in_Pakistan\">corruption</a>. It is a founding member of the Organisation of the Islamic Conference (now the<a title=\"Organisation of Islamic Cooperation\" href=\"http://en.wikipedia.org/wiki/Organisation_of_Islamic_Cooperation\">Organisation of Islamic Cooperation</a>) and is a member of the&nbsp;<a title=\"United Nations\" href=\"http://en.wikipedia.org/wiki/United_Nations\">United Nations</a>, the<a title=\"Commonwealth of Nations\" href=\"http://en.wikipedia.org/wiki/Commonwealth_of_Nations\">Commonwealth of Nations</a>, the&nbsp;<a title=\"Next Eleven\" href=\"http://en.wikipedia.org/wiki/Next_Eleven\">Next Eleven Economies</a>,&nbsp;<a title=\"South Asian Association for Regional Cooperation\" href=\"http://en.wikipedia.org/wiki/South_Asian_Association_for_Regional_Cooperation\">SAARC</a>,&nbsp;<a class=\"mw-redirect\" title=\"Economic Cooperation Organisation\" href=\"http://en.wikipedia.org/wiki/Economic_Cooperation_Organisation\">ECO</a>,&nbsp;<a class=\"mw-redirect\" title=\"Developing Eight\" href=\"http://en.wikipedia.org/wiki/Developing_Eight\">D8</a>&nbsp;and the<a title=\"G20 developing nations\" href=\"http://en.wikipedia.org/wiki/G20_developing_nations\">G20 developing nations</a>.</p>', null);
INSERT INTO `module_cms_detail_2` VALUES ('128', '33', '3', 'Pakistan', 'Pak.jpg', '<p>Pakistan</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Pakistan</strong>&nbsp;(<span class=\"nowrap\"><span class=\"noexcerpt\"><a title=\"Listen\" href=\"http://upload.wikimedia.org/wikipedia/commons/b/b2/En-us-Pakistan.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png\" alt=\"Listen\" width=\"11\" height=\"11\" /></a><sup><span class=\"IPA\"><a title=\"File:En-us-Pakistan.ogg\" href=\"http://en.wikipedia.org/wiki/File:En-us-Pakistan.ogg\">i</a></span></sup></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'p\' in \'pie\'\">p</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/&aelig;/ short \'a\' in \'bad\'\">&aelig;</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'k\' in \'kind\'\">k</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É¨/ \'e\' in \'roses\'\">É¨</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'t\' in \'tie\'\">t</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/&aelig;/ short \'a\' in \'bad\'\">&aelig;</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;or&nbsp;<span class=\"nowrap\"><span class=\"noexcerpt\"><a title=\"Listen\" href=\"http://upload.wikimedia.org/wikipedia/commons/9/9f/En-us-Pakistan-2.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png\" alt=\"Listen\" width=\"11\" height=\"11\" /></a><sup><span class=\"IPA\"><a title=\"File:En-us-Pakistan-2.ogg\" href=\"http://en.wikipedia.org/wiki/File:En-us-Pakistan-2.ogg\">i</a></span></sup></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'p\' in \'pie\'\">p</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É‘Ë/ \'a\' in \'father\'\">É‘Ë</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'k\' in \'kind\'\">k</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/i/ \'y\' in \'happy\'\">i</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'t\' in \'tie\'\">t</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É‘Ë/ \'a\' in \'father\'\">É‘Ë</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>;&nbsp;<a title=\"Urdu\" href=\"http://en.wikipedia.org/wiki/Urdu\">Urdu</a>:&nbsp;<span lang=\"ur\"><span title=\"Nasta\'liq\" lang=\"und-Arab\"><span><a class=\"extiw\" title=\"wikt:Ù¾Ø§ÙƒÙØ³ØªØ§Ù†\" href=\"http://en.wiktionary.org/wiki/%D9%BE%D8%A7%D9%83%D9%90%D8%B3%D8%AA%D8%A7%D9%86\">Ù¾Ø§ÙƒÙØ³ØªØ§Ù†</a></span></span></span>&lrm;) (<small>Urdu pronunciation:&nbsp;</small><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for Hindi and Urdu\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_Hindi_and_Urdu\">[paËkÉªËˆstÌªaËn]</a></span><small class=\"nowrap\">&nbsp;(<a title=\"File:Pakistan pronunciation.ogg\" href=\"http://en.wikipedia.org/wiki/File:Pakistan_pronunciation.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/2/21/Speaker_Icon.svg/13px-Speaker_Icon.svg.png\" alt=\"\" width=\"13\" height=\"13\" /></a>&nbsp;<a class=\"internal\" title=\"Pakistan pronunciation.ogg\" href=\"http://upload.wikimedia.org/wikipedia/en/d/d8/Pakistan_pronunciation.ogg\">listen</a>)</small>), officially the&nbsp;<strong>Islamic Republic of Pakistan</strong>(<a title=\"Urdu\" href=\"http://en.wikipedia.org/wiki/Urdu\">Urdu</a>:&nbsp;<span lang=\"ur\"><span title=\"Nasta\'liq\" lang=\"und-Arab\"><span>Ø§Ø³Ù„Ø§Ù…ÛŒ Ø¬Ù…ÛÙˆØ±ÛŒÛ‚ Ù¾Ø§ÙƒÙØ³ØªØ§Ù†</span></span></span>&lrm;), is a sovereign country in&nbsp;<a title=\"South Asia\" href=\"http://en.wikipedia.org/wiki/South_Asia\">South Asia</a>. With a population exceeding&nbsp;<a title=\"Demographics of Pakistan\" href=\"http://en.wikipedia.org/wiki/Demographics_of_Pakistan\">180 million people</a>, it is the sixth&nbsp;<a title=\"List of countries by population\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_population\">most populous</a>&nbsp;country in the world. Located at the crossroads of the strategically important regions of South Asia, Central Asia and Western Asia, Pakistan has a 1,046-kilometre (650&nbsp;mi) coastline along the&nbsp;<a title=\"Arabian Sea\" href=\"http://en.wikipedia.org/wiki/Arabian_Sea\">Arabian Sea</a>&nbsp;and the&nbsp;<a title=\"Gulf of Oman\" href=\"http://en.wikipedia.org/wiki/Gulf_of_Oman\">Gulf of Oman</a>&nbsp;in the south and is bordered by&nbsp;<a title=\"India\" href=\"http://en.wikipedia.org/wiki/India\">India</a>&nbsp;to the east,&nbsp;<a title=\"Afghanistan\" href=\"http://en.wikipedia.org/wiki/Afghanistan\">Afghanistan</a>&nbsp;to the west and north,&nbsp;<a title=\"Iran\" href=\"http://en.wikipedia.org/wiki/Iran\">Iran</a>&nbsp;to the southwest and&nbsp;<a title=\"China\" href=\"http://en.wikipedia.org/wiki/China\">China</a>&nbsp;in the far northeast. It is separated from&nbsp;<a title=\"Tajikistan\" href=\"http://en.wikipedia.org/wiki/Tajikistan\">Tajikistan</a>&nbsp;by Afghanistan\'s narrow&nbsp;<a title=\"Wakhan Corridor\" href=\"http://en.wikipedia.org/wiki/Wakhan_Corridor\">Wakhan Corridor</a>in the north, and also shares a&nbsp;<a class=\"mw-redirect\" title=\"Marine border\" href=\"http://en.wikipedia.org/wiki/Marine_border\">marine border</a>&nbsp;with&nbsp;<a title=\"Oman\" href=\"http://en.wikipedia.org/wiki/Oman\">Oman</a>.</p>\r\n<p>The territory of modern Pakistan was home to several ancient cultures, including the Neolithic&nbsp;<a title=\"Mehrgarh\" href=\"http://en.wikipedia.org/wiki/Mehrgarh\">Mehrgarh</a>&nbsp;and the Bronze Age&nbsp;<a class=\"mw-redirect\" title=\"Indus Valley Civilisation\" href=\"http://en.wikipedia.org/wiki/Indus_Valley_Civilisation\">Indus Valley Civilisation</a>, and has undergone invasions or settlements by&nbsp;<a title=\"Hindu\" href=\"http://en.wikipedia.org/wiki/Hindu\">Hindu</a>,&nbsp;<a title=\"Iranian peoples\" href=\"http://en.wikipedia.org/wiki/Iranian_peoples\">Persian</a>,&nbsp;<a class=\"mw-redirect\" title=\"Indo-Greek\" href=\"http://en.wikipedia.org/wiki/Indo-Greek\">Indo-Greek</a>,&nbsp;<a title=\"Muslim conquest in the Indian subcontinent\" href=\"http://en.wikipedia.org/wiki/Muslim_conquest_in_the_Indian_subcontinent\">Islamic</a>,&nbsp;<a title=\"Timurid dynasty\" href=\"http://en.wikipedia.org/wiki/Timurid_dynasty\">Turco-Mongol</a>,<a title=\"Afghan (ethnonym)\" href=\"http://en.wikipedia.org/wiki/Afghan_(ethnonym)\">Afghan</a>&nbsp;and&nbsp;<a title=\"Sikh\" href=\"http://en.wikipedia.org/wiki/Sikh\">Sikh</a>&nbsp;cultures. The area has been ruled by numerous empires and dynasties, including the Indian&nbsp;<a class=\"mw-redirect\" title=\"Mauryan Empire\" href=\"http://en.wikipedia.org/wiki/Mauryan_Empire\">Mauryan Empire</a>, the Persian&nbsp;<a title=\"Achaemenid Empire\" href=\"http://en.wikipedia.org/wiki/Achaemenid_Empire\">Achaemenid Empire</a>, the Arab&nbsp;<a title=\"Umayyad Caliphate\" href=\"http://en.wikipedia.org/wiki/Umayyad_Caliphate\">Umayyad Caliphate</a>, the&nbsp;<a title=\"Mongol Empire\" href=\"http://en.wikipedia.org/wiki/Mongol_Empire\">Mongol Empire</a>, the&nbsp;<a title=\"Mughal Empire\" href=\"http://en.wikipedia.org/wiki/Mughal_Empire\">Mughal Empire</a>, the&nbsp;<a title=\"Durrani Empire\" href=\"http://en.wikipedia.org/wiki/Durrani_Empire\">Durrani Empire</a>, the&nbsp;<a title=\"Sikh Empire\" href=\"http://en.wikipedia.org/wiki/Sikh_Empire\">Sikh Empire</a>&nbsp;and the&nbsp;<a title=\"British Raj\" href=\"http://en.wikipedia.org/wiki/British_Raj\">British Empire</a>. As a result of the&nbsp;<a title=\"Pakistan Movement\" href=\"http://en.wikipedia.org/wiki/Pakistan_Movement\">Pakistan Movement</a>&nbsp;led by&nbsp;<a title=\"Muhammad Ali Jinnah\" href=\"http://en.wikipedia.org/wiki/Muhammad_Ali_Jinnah\">Muhammad Ali Jinnah</a>&nbsp;and&nbsp;<a title=\"Indian independence movement\" href=\"http://en.wikipedia.org/wiki/Indian_independence_movement\">India\'s struggle for independence</a>, Pakistan was&nbsp;<a title=\"Indian Independence Act 1947\" href=\"http://en.wikipedia.org/wiki/Indian_Independence_Act_1947\">created in 1947</a>&nbsp;as an independent nation for Muslims from the regions in the east and west of India where there was a Muslim majority. Initially a&nbsp;<a title=\"Dominion of Pakistan\" href=\"http://en.wikipedia.org/wiki/Dominion_of_Pakistan\">dominion</a>, Pakistan adopted a&nbsp;<a title=\"Constitution of Pakistan\" href=\"http://en.wikipedia.org/wiki/Constitution_of_Pakistan\">new constitution</a>&nbsp;in 1956, becoming an&nbsp;<a title=\"Islamic republic\" href=\"http://en.wikipedia.org/wiki/Islamic_republic\">Islamic republic</a>. A&nbsp;<a title=\"Bangladesh Liberation War\" href=\"http://en.wikipedia.org/wiki/Bangladesh_Liberation_War\">civil war</a>&nbsp;in 1971 resulted in the secession of&nbsp;<a title=\"East Pakistan\" href=\"http://en.wikipedia.org/wiki/East_Pakistan\">East Pakistan</a>&nbsp;as the new country of<a title=\"Bangladesh\" href=\"http://en.wikipedia.org/wiki/Bangladesh\">Bangladesh</a>.</p>\r\n<p>Pakistan is a&nbsp;<a title=\"Federation\" href=\"http://en.wikipedia.org/wiki/Federation\">federal</a>&nbsp;<a title=\"Parliamentary republic\" href=\"http://en.wikipedia.org/wiki/Parliamentary_republic\">parliamentary republic</a>&nbsp;consisting of&nbsp;<a title=\"Administrative units of Pakistan\" href=\"http://en.wikipedia.org/wiki/Administrative_units_of_Pakistan\">four provinces and four federal territories</a>. It is an&nbsp;<a title=\"Ethnic groups in Pakistan\" href=\"http://en.wikipedia.org/wiki/Ethnic_groups_in_Pakistan\">ethnically</a>&nbsp;and&nbsp;<a title=\"Languages of Pakistan\" href=\"http://en.wikipedia.org/wiki/Languages_of_Pakistan\">linguistically</a>&nbsp;diverse country, with a similar variation in its&nbsp;<a title=\"Geography of Pakistan\" href=\"http://en.wikipedia.org/wiki/Geography_of_Pakistan\">geography</a>&nbsp;and&nbsp;<a title=\"Fauna of Pakistan\" href=\"http://en.wikipedia.org/wiki/Fauna_of_Pakistan\">wildlife</a>. A&nbsp;<a title=\"Regional power\" href=\"http://en.wikipedia.org/wiki/Regional_power\">regional</a>&nbsp;and&nbsp;<a title=\"Middle power\" href=\"http://en.wikipedia.org/wiki/Middle_power\">middle power</a>,<sup id=\"cite_ref-Buzan2004_11-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Pakistan#cite_note-Buzan2004-11\">[10]</a></sup><sup id=\"cite_ref-Solomon_12-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Pakistan#cite_note-Solomon-12\">[11]</a></sup>&nbsp;Pakistan has the&nbsp;<a class=\"mw-redirect\" title=\"List of countries by number of troops\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_number_of_troops\">seventh largest standing armed forces</a>&nbsp;in the world and is also a&nbsp;<a title=\"Nuclear power in Pakistan\" href=\"http://en.wikipedia.org/wiki/Nuclear_power_in_Pakistan\">nuclear power</a>&nbsp;as well as a declared&nbsp;<a title=\"List of states with nuclear weapons\" href=\"http://en.wikipedia.org/wiki/List_of_states_with_nuclear_weapons\">nuclear weapons</a>&nbsp;state, being the only nation in the<a title=\"Muslim world\" href=\"http://en.wikipedia.org/wiki/Muslim_world\">Muslim world</a>, and the second in South Asia, to have that status. It has a semi-industrialised&nbsp;<a title=\"Economy of Pakistan\" href=\"http://en.wikipedia.org/wiki/Economy_of_Pakistan\">economy</a>&nbsp;which is the&nbsp;<a title=\"List of countries by GDP (PPP)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(PPP)\">27th largest</a>&nbsp;in the world in terms of purchasing power and&nbsp;<a title=\"List of countries by GDP (nominal)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(nominal)\">47th largest</a>&nbsp;in terms of nominal GDP.</p>\r\n<p>Pakistan\'s post-independence history has been characterised by periods of military rule, political instability and&nbsp;<a title=\"Indo-Pakistani wars and conflicts\" href=\"http://en.wikipedia.org/wiki/Indo-Pakistani_wars_and_conflicts\">conflicts with neighbouring India</a>. The country continues to face challenging problems, including&nbsp;<a title=\"Terrorism in Pakistan\" href=\"http://en.wikipedia.org/wiki/Terrorism_in_Pakistan\">terrorism</a>,&nbsp;<a title=\"Poverty in Pakistan\" href=\"http://en.wikipedia.org/wiki/Poverty_in_Pakistan\">poverty</a>,&nbsp;<a title=\"Education in Pakistan\" href=\"http://en.wikipedia.org/wiki/Education_in_Pakistan#Literacy_rate\">illiteracy</a>&nbsp;and&nbsp;<a title=\"Corruption in Pakistan\" href=\"http://en.wikipedia.org/wiki/Corruption_in_Pakistan\">corruption</a>. It is a founding member of the Organisation of the Islamic Conference (now the<a title=\"Organisation of Islamic Cooperation\" href=\"http://en.wikipedia.org/wiki/Organisation_of_Islamic_Cooperation\">Organisation of Islamic Cooperation</a>) and is a member of the&nbsp;<a title=\"United Nations\" href=\"http://en.wikipedia.org/wiki/United_Nations\">United Nations</a>, the<a title=\"Commonwealth of Nations\" href=\"http://en.wikipedia.org/wiki/Commonwealth_of_Nations\">Commonwealth of Nations</a>, the&nbsp;<a title=\"Next Eleven\" href=\"http://en.wikipedia.org/wiki/Next_Eleven\">Next Eleven Economies</a>,&nbsp;<a title=\"South Asian Association for Regional Cooperation\" href=\"http://en.wikipedia.org/wiki/South_Asian_Association_for_Regional_Cooperation\">SAARC</a>,&nbsp;<a class=\"mw-redirect\" title=\"Economic Cooperation Organisation\" href=\"http://en.wikipedia.org/wiki/Economic_Cooperation_Organisation\">ECO</a>,&nbsp;<a class=\"mw-redirect\" title=\"Developing Eight\" href=\"http://en.wikipedia.org/wiki/Developing_Eight\">D8</a>&nbsp;and the<a title=\"G20 developing nations\" href=\"http://en.wikipedia.org/wiki/G20_developing_nations\">G20 developing nations</a>.</p>', null);
INSERT INTO `module_cms_detail_2` VALUES ('129', '33', '4', 'Pakistan', 'Pak.jpg', '<p>Pakistan</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Pakistan</strong>&nbsp;(<span class=\"nowrap\"><span class=\"noexcerpt\"><a title=\"Listen\" href=\"http://upload.wikimedia.org/wikipedia/commons/b/b2/En-us-Pakistan.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png\" alt=\"Listen\" width=\"11\" height=\"11\" /></a><sup><span class=\"IPA\"><a title=\"File:En-us-Pakistan.ogg\" href=\"http://en.wikipedia.org/wiki/File:En-us-Pakistan.ogg\">i</a></span></sup></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'p\' in \'pie\'\">p</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/&aelig;/ short \'a\' in \'bad\'\">&aelig;</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'k\' in \'kind\'\">k</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É¨/ \'e\' in \'roses\'\">É¨</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'t\' in \'tie\'\">t</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/&aelig;/ short \'a\' in \'bad\'\">&aelig;</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;or&nbsp;<span class=\"nowrap\"><span class=\"noexcerpt\"><a title=\"Listen\" href=\"http://upload.wikimedia.org/wikipedia/commons/9/9f/En-us-Pakistan-2.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png\" alt=\"Listen\" width=\"11\" height=\"11\" /></a><sup><span class=\"IPA\"><a title=\"File:En-us-Pakistan-2.ogg\" href=\"http://en.wikipedia.org/wiki/File:En-us-Pakistan-2.ogg\">i</a></span></sup></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'p\' in \'pie\'\">p</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É‘Ë/ \'a\' in \'father\'\">É‘Ë</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'k\' in \'kind\'\">k</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/i/ \'y\' in \'happy\'\">i</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'t\' in \'tie\'\">t</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É‘Ë/ \'a\' in \'father\'\">É‘Ë</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>;&nbsp;<a title=\"Urdu\" href=\"http://en.wikipedia.org/wiki/Urdu\">Urdu</a>:&nbsp;<span lang=\"ur\"><span title=\"Nasta\'liq\" lang=\"und-Arab\"><span><a class=\"extiw\" title=\"wikt:Ù¾Ø§ÙƒÙØ³ØªØ§Ù†\" href=\"http://en.wiktionary.org/wiki/%D9%BE%D8%A7%D9%83%D9%90%D8%B3%D8%AA%D8%A7%D9%86\">Ù¾Ø§ÙƒÙØ³ØªØ§Ù†</a></span></span></span>&lrm;) (<small>Urdu pronunciation:&nbsp;</small><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for Hindi and Urdu\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_Hindi_and_Urdu\">[paËkÉªËˆstÌªaËn]</a></span><small class=\"nowrap\">&nbsp;(<a title=\"File:Pakistan pronunciation.ogg\" href=\"http://en.wikipedia.org/wiki/File:Pakistan_pronunciation.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/2/21/Speaker_Icon.svg/13px-Speaker_Icon.svg.png\" alt=\"\" width=\"13\" height=\"13\" /></a>&nbsp;<a class=\"internal\" title=\"Pakistan pronunciation.ogg\" href=\"http://upload.wikimedia.org/wikipedia/en/d/d8/Pakistan_pronunciation.ogg\">listen</a>)</small>), officially the&nbsp;<strong>Islamic Republic of Pakistan</strong>(<a title=\"Urdu\" href=\"http://en.wikipedia.org/wiki/Urdu\">Urdu</a>:&nbsp;<span lang=\"ur\"><span title=\"Nasta\'liq\" lang=\"und-Arab\"><span>Ø§Ø³Ù„Ø§Ù…ÛŒ Ø¬Ù…ÛÙˆØ±ÛŒÛ‚ Ù¾Ø§ÙƒÙØ³ØªØ§Ù†</span></span></span>&lrm;), is a sovereign country in&nbsp;<a title=\"South Asia\" href=\"http://en.wikipedia.org/wiki/South_Asia\">South Asia</a>. With a population exceeding&nbsp;<a title=\"Demographics of Pakistan\" href=\"http://en.wikipedia.org/wiki/Demographics_of_Pakistan\">180 million people</a>, it is the sixth&nbsp;<a title=\"List of countries by population\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_population\">most populous</a>&nbsp;country in the world. Located at the crossroads of the strategically important regions of South Asia, Central Asia and Western Asia, Pakistan has a 1,046-kilometre (650&nbsp;mi) coastline along the&nbsp;<a title=\"Arabian Sea\" href=\"http://en.wikipedia.org/wiki/Arabian_Sea\">Arabian Sea</a>&nbsp;and the&nbsp;<a title=\"Gulf of Oman\" href=\"http://en.wikipedia.org/wiki/Gulf_of_Oman\">Gulf of Oman</a>&nbsp;in the south and is bordered by&nbsp;<a title=\"India\" href=\"http://en.wikipedia.org/wiki/India\">India</a>&nbsp;to the east,&nbsp;<a title=\"Afghanistan\" href=\"http://en.wikipedia.org/wiki/Afghanistan\">Afghanistan</a>&nbsp;to the west and north,&nbsp;<a title=\"Iran\" href=\"http://en.wikipedia.org/wiki/Iran\">Iran</a>&nbsp;to the southwest and&nbsp;<a title=\"China\" href=\"http://en.wikipedia.org/wiki/China\">China</a>&nbsp;in the far northeast. It is separated from&nbsp;<a title=\"Tajikistan\" href=\"http://en.wikipedia.org/wiki/Tajikistan\">Tajikistan</a>&nbsp;by Afghanistan\'s narrow&nbsp;<a title=\"Wakhan Corridor\" href=\"http://en.wikipedia.org/wiki/Wakhan_Corridor\">Wakhan Corridor</a>in the north, and also shares a&nbsp;<a class=\"mw-redirect\" title=\"Marine border\" href=\"http://en.wikipedia.org/wiki/Marine_border\">marine border</a>&nbsp;with&nbsp;<a title=\"Oman\" href=\"http://en.wikipedia.org/wiki/Oman\">Oman</a>.</p>\r\n<p>The territory of modern Pakistan was home to several ancient cultures, including the Neolithic&nbsp;<a title=\"Mehrgarh\" href=\"http://en.wikipedia.org/wiki/Mehrgarh\">Mehrgarh</a>&nbsp;and the Bronze Age&nbsp;<a class=\"mw-redirect\" title=\"Indus Valley Civilisation\" href=\"http://en.wikipedia.org/wiki/Indus_Valley_Civilisation\">Indus Valley Civilisation</a>, and has undergone invasions or settlements by&nbsp;<a title=\"Hindu\" href=\"http://en.wikipedia.org/wiki/Hindu\">Hindu</a>,&nbsp;<a title=\"Iranian peoples\" href=\"http://en.wikipedia.org/wiki/Iranian_peoples\">Persian</a>,&nbsp;<a class=\"mw-redirect\" title=\"Indo-Greek\" href=\"http://en.wikipedia.org/wiki/Indo-Greek\">Indo-Greek</a>,&nbsp;<a title=\"Muslim conquest in the Indian subcontinent\" href=\"http://en.wikipedia.org/wiki/Muslim_conquest_in_the_Indian_subcontinent\">Islamic</a>,&nbsp;<a title=\"Timurid dynasty\" href=\"http://en.wikipedia.org/wiki/Timurid_dynasty\">Turco-Mongol</a>,<a title=\"Afghan (ethnonym)\" href=\"http://en.wikipedia.org/wiki/Afghan_(ethnonym)\">Afghan</a>&nbsp;and&nbsp;<a title=\"Sikh\" href=\"http://en.wikipedia.org/wiki/Sikh\">Sikh</a>&nbsp;cultures. The area has been ruled by numerous empires and dynasties, including the Indian&nbsp;<a class=\"mw-redirect\" title=\"Mauryan Empire\" href=\"http://en.wikipedia.org/wiki/Mauryan_Empire\">Mauryan Empire</a>, the Persian&nbsp;<a title=\"Achaemenid Empire\" href=\"http://en.wikipedia.org/wiki/Achaemenid_Empire\">Achaemenid Empire</a>, the Arab&nbsp;<a title=\"Umayyad Caliphate\" href=\"http://en.wikipedia.org/wiki/Umayyad_Caliphate\">Umayyad Caliphate</a>, the&nbsp;<a title=\"Mongol Empire\" href=\"http://en.wikipedia.org/wiki/Mongol_Empire\">Mongol Empire</a>, the&nbsp;<a title=\"Mughal Empire\" href=\"http://en.wikipedia.org/wiki/Mughal_Empire\">Mughal Empire</a>, the&nbsp;<a title=\"Durrani Empire\" href=\"http://en.wikipedia.org/wiki/Durrani_Empire\">Durrani Empire</a>, the&nbsp;<a title=\"Sikh Empire\" href=\"http://en.wikipedia.org/wiki/Sikh_Empire\">Sikh Empire</a>&nbsp;and the&nbsp;<a title=\"British Raj\" href=\"http://en.wikipedia.org/wiki/British_Raj\">British Empire</a>. As a result of the&nbsp;<a title=\"Pakistan Movement\" href=\"http://en.wikipedia.org/wiki/Pakistan_Movement\">Pakistan Movement</a>&nbsp;led by&nbsp;<a title=\"Muhammad Ali Jinnah\" href=\"http://en.wikipedia.org/wiki/Muhammad_Ali_Jinnah\">Muhammad Ali Jinnah</a>&nbsp;and&nbsp;<a title=\"Indian independence movement\" href=\"http://en.wikipedia.org/wiki/Indian_independence_movement\">India\'s struggle for independence</a>, Pakistan was&nbsp;<a title=\"Indian Independence Act 1947\" href=\"http://en.wikipedia.org/wiki/Indian_Independence_Act_1947\">created in 1947</a>&nbsp;as an independent nation for Muslims from the regions in the east and west of India where there was a Muslim majority. Initially a&nbsp;<a title=\"Dominion of Pakistan\" href=\"http://en.wikipedia.org/wiki/Dominion_of_Pakistan\">dominion</a>, Pakistan adopted a&nbsp;<a title=\"Constitution of Pakistan\" href=\"http://en.wikipedia.org/wiki/Constitution_of_Pakistan\">new constitution</a>&nbsp;in 1956, becoming an&nbsp;<a title=\"Islamic republic\" href=\"http://en.wikipedia.org/wiki/Islamic_republic\">Islamic republic</a>. A&nbsp;<a title=\"Bangladesh Liberation War\" href=\"http://en.wikipedia.org/wiki/Bangladesh_Liberation_War\">civil war</a>&nbsp;in 1971 resulted in the secession of&nbsp;<a title=\"East Pakistan\" href=\"http://en.wikipedia.org/wiki/East_Pakistan\">East Pakistan</a>&nbsp;as the new country of<a title=\"Bangladesh\" href=\"http://en.wikipedia.org/wiki/Bangladesh\">Bangladesh</a>.</p>\r\n<p>Pakistan is a&nbsp;<a title=\"Federation\" href=\"http://en.wikipedia.org/wiki/Federation\">federal</a>&nbsp;<a title=\"Parliamentary republic\" href=\"http://en.wikipedia.org/wiki/Parliamentary_republic\">parliamentary republic</a>&nbsp;consisting of&nbsp;<a title=\"Administrative units of Pakistan\" href=\"http://en.wikipedia.org/wiki/Administrative_units_of_Pakistan\">four provinces and four federal territories</a>. It is an&nbsp;<a title=\"Ethnic groups in Pakistan\" href=\"http://en.wikipedia.org/wiki/Ethnic_groups_in_Pakistan\">ethnically</a>&nbsp;and&nbsp;<a title=\"Languages of Pakistan\" href=\"http://en.wikipedia.org/wiki/Languages_of_Pakistan\">linguistically</a>&nbsp;diverse country, with a similar variation in its&nbsp;<a title=\"Geography of Pakistan\" href=\"http://en.wikipedia.org/wiki/Geography_of_Pakistan\">geography</a>&nbsp;and&nbsp;<a title=\"Fauna of Pakistan\" href=\"http://en.wikipedia.org/wiki/Fauna_of_Pakistan\">wildlife</a>. A&nbsp;<a title=\"Regional power\" href=\"http://en.wikipedia.org/wiki/Regional_power\">regional</a>&nbsp;and&nbsp;<a title=\"Middle power\" href=\"http://en.wikipedia.org/wiki/Middle_power\">middle power</a>,<sup id=\"cite_ref-Buzan2004_11-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Pakistan#cite_note-Buzan2004-11\">[10]</a></sup><sup id=\"cite_ref-Solomon_12-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/Pakistan#cite_note-Solomon-12\">[11]</a></sup>&nbsp;Pakistan has the&nbsp;<a class=\"mw-redirect\" title=\"List of countries by number of troops\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_number_of_troops\">seventh largest standing armed forces</a>&nbsp;in the world and is also a&nbsp;<a title=\"Nuclear power in Pakistan\" href=\"http://en.wikipedia.org/wiki/Nuclear_power_in_Pakistan\">nuclear power</a>&nbsp;as well as a declared&nbsp;<a title=\"List of states with nuclear weapons\" href=\"http://en.wikipedia.org/wiki/List_of_states_with_nuclear_weapons\">nuclear weapons</a>&nbsp;state, being the only nation in the<a title=\"Muslim world\" href=\"http://en.wikipedia.org/wiki/Muslim_world\">Muslim world</a>, and the second in South Asia, to have that status. It has a semi-industrialised&nbsp;<a title=\"Economy of Pakistan\" href=\"http://en.wikipedia.org/wiki/Economy_of_Pakistan\">economy</a>&nbsp;which is the&nbsp;<a title=\"List of countries by GDP (PPP)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(PPP)\">27th largest</a>&nbsp;in the world in terms of purchasing power and&nbsp;<a title=\"List of countries by GDP (nominal)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(nominal)\">47th largest</a>&nbsp;in terms of nominal GDP.</p>\r\n<p>Pakistan\'s post-independence history has been characterised by periods of military rule, political instability and&nbsp;<a title=\"Indo-Pakistani wars and conflicts\" href=\"http://en.wikipedia.org/wiki/Indo-Pakistani_wars_and_conflicts\">conflicts with neighbouring India</a>. The country continues to face challenging problems, including&nbsp;<a title=\"Terrorism in Pakistan\" href=\"http://en.wikipedia.org/wiki/Terrorism_in_Pakistan\">terrorism</a>,&nbsp;<a title=\"Poverty in Pakistan\" href=\"http://en.wikipedia.org/wiki/Poverty_in_Pakistan\">poverty</a>,&nbsp;<a title=\"Education in Pakistan\" href=\"http://en.wikipedia.org/wiki/Education_in_Pakistan#Literacy_rate\">illiteracy</a>&nbsp;and&nbsp;<a title=\"Corruption in Pakistan\" href=\"http://en.wikipedia.org/wiki/Corruption_in_Pakistan\">corruption</a>. It is a founding member of the Organisation of the Islamic Conference (now the<a title=\"Organisation of Islamic Cooperation\" href=\"http://en.wikipedia.org/wiki/Organisation_of_Islamic_Cooperation\">Organisation of Islamic Cooperation</a>) and is a member of the&nbsp;<a title=\"United Nations\" href=\"http://en.wikipedia.org/wiki/United_Nations\">United Nations</a>, the<a title=\"Commonwealth of Nations\" href=\"http://en.wikipedia.org/wiki/Commonwealth_of_Nations\">Commonwealth of Nations</a>, the&nbsp;<a title=\"Next Eleven\" href=\"http://en.wikipedia.org/wiki/Next_Eleven\">Next Eleven Economies</a>,&nbsp;<a title=\"South Asian Association for Regional Cooperation\" href=\"http://en.wikipedia.org/wiki/South_Asian_Association_for_Regional_Cooperation\">SAARC</a>,&nbsp;<a class=\"mw-redirect\" title=\"Economic Cooperation Organisation\" href=\"http://en.wikipedia.org/wiki/Economic_Cooperation_Organisation\">ECO</a>,&nbsp;<a class=\"mw-redirect\" title=\"Developing Eight\" href=\"http://en.wikipedia.org/wiki/Developing_Eight\">D8</a>&nbsp;and the<a title=\"G20 developing nations\" href=\"http://en.wikipedia.org/wiki/G20_developing_nations\">G20 developing nations</a>.</p>', null);
INSERT INTO `module_cms_detail_2` VALUES ('130', '34', '1', 'France', 'france_1.jpg', '<p>France</p>\r\n<p>&nbsp;</p>\r\n<p><strong>France</strong>&nbsp;(<span class=\"nowrap\"><small>English</small>&nbsp;<span class=\"noexcerpt\"><a title=\"Listen\" href=\"http://upload.wikimedia.org/wikipedia/commons/5/51/En-us-France.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png\" alt=\"Listen\" width=\"11\" height=\"11\" /></a><sup><span class=\"IPA\"><a title=\"File:En-us-France.ogg\" href=\"http://en.wikipedia.org/wiki/File:En-us-France.ogg\">i</a></span></sup></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'f\' in \'find\'\">f</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'r\' in \'rye\'\">r</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/&aelig;/ short \'a\' in \'bad\'\">&aelig;</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;<span class=\"Unicode\" title=\"English pronunciation respelling\"><a title=\"Wikipedia:Pronunciation respelling key\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Pronunciation_respelling_key\"><em><strong><span class=\"smallcaps\"><span class=\"SMALLCAPS\"><span class=\"NOCAPS\">franss</span></span></span></strong></em></a></span>&nbsp;or&nbsp;<span class=\"nowrap\"><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'f\' in \'find\'\">f</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'r\' in \'rye\'\">r</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É‘Ë/ \'a\' in \'father\'\">É‘Ë</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;<span class=\"Unicode\" title=\"English pronunciation respelling\"><a title=\"Wikipedia:Pronunciation respelling key\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Pronunciation_respelling_key\"><em><strong><span class=\"smallcaps\"><span class=\"SMALLCAPS\"><span class=\"NOCAPS\">frahnss</span></span></span></strong></em></a></span>;&nbsp;<small>French:&nbsp;</small><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for French\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_French\">[fÊÉ‘Ìƒs]</a></span><small class=\"nowrap\">&nbsp;(<a title=\"File:Fr-France.ogg\" href=\"http://en.wikipedia.org/wiki/File:Fr-France.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/2/21/Speaker_Icon.svg/13px-Speaker_Icon.svg.png\" alt=\"\" width=\"13\" height=\"13\" /></a>&nbsp;<a class=\"internal\" title=\"Fr-France.ogg\" href=\"http://upload.wikimedia.org/wikipedia/commons/a/a3/Fr-France.ogg\">listen</a>)</small>), officially the&nbsp;<strong>French Republic</strong>&nbsp;(<a title=\"French language\" href=\"http://en.wikipedia.org/wiki/French_language\">French</a>:&nbsp;<span lang=\"fr\"><em>R&eacute;publique fran&ccedil;aise</em></span>&nbsp;<small><a title=\"French language\" href=\"http://en.wikipedia.org/wiki/French_language\">French</a>pronunciation:&nbsp;</small><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for French\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_French\">[Êepyblik fÊÉ‘ÌƒsÉ›z]</a></span>), is a&nbsp;<a title=\"Unitary state\" href=\"http://en.wikipedia.org/wiki/Unitary_state\">unitary</a>&nbsp;<a title=\"Semi-presidential system\" href=\"http://en.wikipedia.org/wiki/Semi-presidential_system\">semi-presidential</a>&nbsp;republic located mostly in&nbsp;<a title=\"Western Europe\" href=\"http://en.wikipedia.org/wiki/Western_Europe\">Western Europe</a>,<sup id=\"cite_ref-twelve_17-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-twelve-17\">[note 12]</a></sup>&nbsp;with several&nbsp;<a title=\"Overseas departments and territories of France\" href=\"http://en.wikipedia.org/wiki/Overseas_departments_and_territories_of_France\">overseas regions and territories</a>.&nbsp;<a title=\"Metropolitan France\" href=\"http://en.wikipedia.org/wiki/Metropolitan_France\">Metropolitan France</a>&nbsp;extends from the&nbsp;<a title=\"Mediterranean Sea\" href=\"http://en.wikipedia.org/wiki/Mediterranean_Sea\">Mediterranean Sea</a>&nbsp;to the&nbsp;<a title=\"English Channel\" href=\"http://en.wikipedia.org/wiki/English_Channel\">English Channel</a>&nbsp;and the&nbsp;<a title=\"North Sea\" href=\"http://en.wikipedia.org/wiki/North_Sea\">North Sea</a>, and from the&nbsp;<a title=\"Rhine\" href=\"http://en.wikipedia.org/wiki/Rhine\">Rhine</a>&nbsp;to the&nbsp;<a title=\"Atlantic Ocean\" href=\"http://en.wikipedia.org/wiki/Atlantic_Ocean\">Atlantic Ocean</a>. From its shape, it is often referred to in French as&nbsp;<em><span lang=\"fr\">l&rsquo;Hexagone</span></em>&nbsp;(\"The&nbsp;<a title=\"Hexagon\" href=\"http://en.wikipedia.org/wiki/Hexagon\">Hexagon</a>\").</p>\r\n<p>France is the largest country in Western Europe and the third-largest in Europe as a whole. It possesses the second-largest&nbsp;<a title=\"Exclusive economic zone\" href=\"http://en.wikipedia.org/wiki/Exclusive_economic_zone\">exclusive economic zone</a>&nbsp;in the world. France has been a&nbsp;<a class=\"mw-redirect\" title=\"Major power\" href=\"http://en.wikipedia.org/wiki/Major_power\">major power</a>&nbsp;with strong&nbsp;<a title=\"Culture of France\" href=\"http://en.wikipedia.org/wiki/Culture_of_France\">cultural</a>,&nbsp;<a title=\"Economy of France\" href=\"http://en.wikipedia.org/wiki/Economy_of_France\">economic</a>,&nbsp;<a title=\"French Armed Forces\" href=\"http://en.wikipedia.org/wiki/French_Armed_Forces\">military</a>, and&nbsp;<a title=\"Foreign relations of France\" href=\"http://en.wikipedia.org/wiki/Foreign_relations_of_France\">political</a>&nbsp;influence in Europe and around the world.<sup id=\"cite_ref-18\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-18\">[6]</a></sup>&nbsp;France has its main ideals expressed in the 18th-century&nbsp;<em><a title=\"Declaration of the Rights of Man and of the Citizen\" href=\"http://en.wikipedia.org/wiki/Declaration_of_the_Rights_of_Man_and_of_the_Citizen\">Declaration of the Rights of Man and of the Citizen</a></em>. From the 17th to the early 20th century, France built the&nbsp;<a title=\"French colonial empire\" href=\"http://en.wikipedia.org/wiki/French_colonial_empire\">second-largest colonial empire</a>&nbsp;of the time, ruling large portions of first&nbsp;<a title=\"New France\" href=\"http://en.wikipedia.org/wiki/New_France\">North America</a>&nbsp;and&nbsp;<a title=\"French India\" href=\"http://en.wikipedia.org/wiki/French_India\">India</a>&nbsp;and then&nbsp;<a title=\"French West Africa\" href=\"http://en.wikipedia.org/wiki/French_West_Africa\">Northwest</a>&nbsp;and&nbsp;<a title=\"French Equatorial Africa\" href=\"http://en.wikipedia.org/wiki/French_Equatorial_Africa\">Central Africa</a>;<a title=\"French Madagascar\" href=\"http://en.wikipedia.org/wiki/French_Madagascar\">Madagascar</a>;&nbsp;<a title=\"French Indochina\" href=\"http://en.wikipedia.org/wiki/French_Indochina\">Indochina</a>&nbsp;and southeast&nbsp;<a class=\"mw-redirect\" title=\"French China\" href=\"http://en.wikipedia.org/wiki/French_China\">China</a>; and many&nbsp;<a title=\"French West Indies\" href=\"http://en.wikipedia.org/wiki/French_West_Indies\">Caribbean</a>&nbsp;and&nbsp;<a title=\"French Polynesia\" href=\"http://en.wikipedia.org/wiki/French_Polynesia\">Pacific Islands</a>.</p>\r\n<p>France is a&nbsp;<a title=\"Developed country\" href=\"http://en.wikipedia.org/wiki/Developed_country\">developed country</a>,<sup id=\"cite_ref-19\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-19\">[7]</a></sup>&nbsp;possessing the world\'s&nbsp;<a title=\"List of countries by GDP (nominal)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(nominal)\">fifth-largest</a>&nbsp;and Europe\'s<a title=\"List of sovereign states in Europe by GDP (nominal)\" href=\"http://en.wikipedia.org/wiki/List_of_sovereign_states_in_Europe_by_GDP_(nominal)\">second-largest</a>&nbsp;economy by&nbsp;<a class=\"mw-redirect\" title=\"Nominal GDP\" href=\"http://en.wikipedia.org/wiki/Nominal_GDP\">nominal GDP</a>. It is also the world\'s&nbsp;<a title=\"List of countries by GDP (PPP)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(PPP)\">ninth-largest</a>&nbsp;by&nbsp;<a class=\"mw-redirect\" title=\"GDP at purchasing power parity\" href=\"http://en.wikipedia.org/wiki/GDP_at_purchasing_power_parity\">GDP at purchasing power parity</a>.<sup id=\"cite_ref-20\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-20\">[8]</a></sup>&nbsp;France is the wealthiest nation in Europe &ndash; and the fourth-wealthiest in the world &ndash; in aggregate household wealth.<sup id=\"cite_ref-21\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-21\">[9]</a></sup>&nbsp;French citizens enjoy a high<a title=\"Standard of living\" href=\"http://en.wikipedia.org/wiki/Standard_of_living\">standard of living</a>, high&nbsp;<a title=\"Education Index\" href=\"http://en.wikipedia.org/wiki/Education_Index\">public education level</a>, and one of the world\'s longest&nbsp;<a title=\"List of countries by life expectancy\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_life_expectancy\">life expectancies</a>.<sup id=\"cite_ref-22\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-22\">[10]</a></sup>&nbsp;France has been listed as the world\'s \"best overall health care\" provider by the&nbsp;<a title=\"World Health Organization\" href=\"http://en.wikipedia.org/wiki/World_Health_Organization\">World Health Organization</a>.<sup id=\"cite_ref-23\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-23\">[11]</a></sup>&nbsp;It is the most-visited country in the world, receiving 79.5&nbsp;million foreign tourists annually.<sup id=\"cite_ref-tourism.stat_24-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-tourism.stat-24\">[12]</a></sup></p>\r\n<p>France has the world\'s&nbsp;<a title=\"List of countries by military expenditures\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_military_expenditures\">fifth-largest nominal military budget</a>,<sup id=\"cite_ref-SIPRI_Yearbook_2012_25-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-SIPRI_Yearbook_2012-25\">[13]</a></sup>&nbsp;as well as (in terms of personnel) the largest military in the&nbsp;<a title=\"European Union\" href=\"http://en.wikipedia.org/wiki/European_Union\">EU</a>,<sup class=\"Template-Fact\">[<em><a title=\"Wikipedia:Citation needed\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Citation_needed\"><span title=\"This claim needs references to reliable sources from November 2012\">citation needed</span></a></em>]</sup>&nbsp;the third-largest deployable force in&nbsp;<a title=\"NATO\" href=\"http://en.wikipedia.org/wiki/NATO\">NATO</a>, and the&nbsp;<a title=\"List of countries by number of military and paramilitary personnel\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_number_of_military_and_paramilitary_personnel\">26th-largest military</a>&nbsp;in the world. France also possesses the third-largest stockpile of&nbsp;<a title=\"List of states with nuclear weapons\" href=\"http://en.wikipedia.org/wiki/List_of_states_with_nuclear_weapons\">nuclear weapons</a>&nbsp;in the world<sup id=\"cite_ref-26\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-26\">[14]</a></sup>&nbsp;&ndash; with around 300 active warheads as of 25&nbsp;May&nbsp;2010&nbsp;&ndash; and the&nbsp;<a title=\"List of diplomatic missions of France\" href=\"http://en.wikipedia.org/wiki/List_of_diplomatic_missions_of_France\">world\'s second-largest diplomatic corps</a>&nbsp;(behind the&nbsp;<a class=\"mw-redirect\" title=\"State Department (US)\" href=\"http://en.wikipedia.org/wiki/State_Department_(US)\">United States</a>).<sup id=\"cite_ref-27\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-27\">[15]</a></sup>&nbsp;France is a founding member of the&nbsp;<a title=\"United Nations\" href=\"http://en.wikipedia.org/wiki/United_Nations\">United Nations</a>, one of the five&nbsp;<a title=\"Permanent members of the United Nations Security Council\" href=\"http://en.wikipedia.org/wiki/Permanent_members_of_the_United_Nations_Security_Council\">permanent members of the UN Security Council</a>, and a member of the<a title=\"Organisation internationale de la Francophonie\" href=\"http://en.wikipedia.org/wiki/Organisation_internationale_de_la_Francophonie\">Francophonie</a>, the&nbsp;<a title=\"G8\" href=\"http://en.wikipedia.org/wiki/G8\">G8</a>,&nbsp;<a title=\"G-20 major economies\" href=\"http://en.wikipedia.org/wiki/G-20_major_economies\">G20</a>, NATO,&nbsp;<a title=\"Organisation for Economic Co-operation and Development\" href=\"http://en.wikipedia.org/wiki/Organisation_for_Economic_Co-operation_and_Development\">OECD</a>,&nbsp;<a title=\"World Trade Organization\" href=\"http://en.wikipedia.org/wiki/World_Trade_Organization\">WTO</a>, and the&nbsp;<a title=\"Latin Union\" href=\"http://en.wikipedia.org/wiki/Latin_Union\">Latin Union</a>. It is also a founding and leading&nbsp;<a title=\"Member state of the European Union\" href=\"http://en.wikipedia.org/wiki/Member_state_of_the_European_Union\">member state of the European Union</a>&nbsp;and the largest EU state by area.<sup id=\"cite_ref-superficy_28-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-superficy-28\">[16]</a></sup>&nbsp;In 2011, France was listed 20th on the&nbsp;<a title=\"Human Development Index\" href=\"http://en.wikipedia.org/wiki/Human_Development_Index\">Human Development Index</a>&nbsp;and, in 2010, 24th on the&nbsp;<a title=\"Corruption Perceptions Index\" href=\"http://en.wikipedia.org/wiki/Corruption_Perceptions_Index\">Corruption Perceptions Index</a>.</p>', null);
INSERT INTO `module_cms_detail_2` VALUES ('131', '34', '2', 'France', 'france.jpg', '<p>France</p>\r\n<p>&nbsp;</p>\r\n<p><strong>France</strong>&nbsp;(<span class=\"nowrap\"><small>English</small>&nbsp;<span class=\"noexcerpt\"><a title=\"Listen\" href=\"http://upload.wikimedia.org/wikipedia/commons/5/51/En-us-France.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png\" alt=\"Listen\" width=\"11\" height=\"11\" /></a><sup><span class=\"IPA\"><a title=\"File:En-us-France.ogg\" href=\"http://en.wikipedia.org/wiki/File:En-us-France.ogg\">i</a></span></sup></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'f\' in \'find\'\">f</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'r\' in \'rye\'\">r</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/&aelig;/ short \'a\' in \'bad\'\">&aelig;</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;<span class=\"Unicode\" title=\"English pronunciation respelling\"><a title=\"Wikipedia:Pronunciation respelling key\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Pronunciation_respelling_key\"><em><strong><span class=\"smallcaps\"><span class=\"SMALLCAPS\"><span class=\"NOCAPS\">franss</span></span></span></strong></em></a></span>&nbsp;or&nbsp;<span class=\"nowrap\"><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'f\' in \'find\'\">f</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'r\' in \'rye\'\">r</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É‘Ë/ \'a\' in \'father\'\">É‘Ë</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;<span class=\"Unicode\" title=\"English pronunciation respelling\"><a title=\"Wikipedia:Pronunciation respelling key\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Pronunciation_respelling_key\"><em><strong><span class=\"smallcaps\"><span class=\"SMALLCAPS\"><span class=\"NOCAPS\">frahnss</span></span></span></strong></em></a></span>;&nbsp;<small>French:&nbsp;</small><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for French\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_French\">[fÊÉ‘Ìƒs]</a></span><small class=\"nowrap\">&nbsp;(<a title=\"File:Fr-France.ogg\" href=\"http://en.wikipedia.org/wiki/File:Fr-France.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/2/21/Speaker_Icon.svg/13px-Speaker_Icon.svg.png\" alt=\"\" width=\"13\" height=\"13\" /></a>&nbsp;<a class=\"internal\" title=\"Fr-France.ogg\" href=\"http://upload.wikimedia.org/wikipedia/commons/a/a3/Fr-France.ogg\">listen</a>)</small>), officially the&nbsp;<strong>French Republic</strong>&nbsp;(<a title=\"French language\" href=\"http://en.wikipedia.org/wiki/French_language\">French</a>:&nbsp;<span lang=\"fr\"><em>R&eacute;publique fran&ccedil;aise</em></span>&nbsp;<small><a title=\"French language\" href=\"http://en.wikipedia.org/wiki/French_language\">French</a>pronunciation:&nbsp;</small><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for French\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_French\">[Êepyblik fÊÉ‘ÌƒsÉ›z]</a></span>), is a&nbsp;<a title=\"Unitary state\" href=\"http://en.wikipedia.org/wiki/Unitary_state\">unitary</a>&nbsp;<a title=\"Semi-presidential system\" href=\"http://en.wikipedia.org/wiki/Semi-presidential_system\">semi-presidential</a>&nbsp;republic located mostly in&nbsp;<a title=\"Western Europe\" href=\"http://en.wikipedia.org/wiki/Western_Europe\">Western Europe</a>,<sup id=\"cite_ref-twelve_17-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-twelve-17\">[note 12]</a></sup>&nbsp;with several&nbsp;<a title=\"Overseas departments and territories of France\" href=\"http://en.wikipedia.org/wiki/Overseas_departments_and_territories_of_France\">overseas regions and territories</a>.&nbsp;<a title=\"Metropolitan France\" href=\"http://en.wikipedia.org/wiki/Metropolitan_France\">Metropolitan France</a>&nbsp;extends from the&nbsp;<a title=\"Mediterranean Sea\" href=\"http://en.wikipedia.org/wiki/Mediterranean_Sea\">Mediterranean Sea</a>&nbsp;to the&nbsp;<a title=\"English Channel\" href=\"http://en.wikipedia.org/wiki/English_Channel\">English Channel</a>&nbsp;and the&nbsp;<a title=\"North Sea\" href=\"http://en.wikipedia.org/wiki/North_Sea\">North Sea</a>, and from the&nbsp;<a title=\"Rhine\" href=\"http://en.wikipedia.org/wiki/Rhine\">Rhine</a>&nbsp;to the&nbsp;<a title=\"Atlantic Ocean\" href=\"http://en.wikipedia.org/wiki/Atlantic_Ocean\">Atlantic Ocean</a>. From its shape, it is often referred to in French as&nbsp;<em><span lang=\"fr\">l&rsquo;Hexagone</span></em>&nbsp;(\"The&nbsp;<a title=\"Hexagon\" href=\"http://en.wikipedia.org/wiki/Hexagon\">Hexagon</a>\").</p>\r\n<p>France is the largest country in Western Europe and the third-largest in Europe as a whole. It possesses the second-largest&nbsp;<a title=\"Exclusive economic zone\" href=\"http://en.wikipedia.org/wiki/Exclusive_economic_zone\">exclusive economic zone</a>&nbsp;in the world. France has been a&nbsp;<a class=\"mw-redirect\" title=\"Major power\" href=\"http://en.wikipedia.org/wiki/Major_power\">major power</a>&nbsp;with strong&nbsp;<a title=\"Culture of France\" href=\"http://en.wikipedia.org/wiki/Culture_of_France\">cultural</a>,&nbsp;<a title=\"Economy of France\" href=\"http://en.wikipedia.org/wiki/Economy_of_France\">economic</a>,&nbsp;<a title=\"French Armed Forces\" href=\"http://en.wikipedia.org/wiki/French_Armed_Forces\">military</a>, and&nbsp;<a title=\"Foreign relations of France\" href=\"http://en.wikipedia.org/wiki/Foreign_relations_of_France\">political</a>&nbsp;influence in Europe and around the world.<sup id=\"cite_ref-18\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-18\">[6]</a></sup>&nbsp;France has its main ideals expressed in the 18th-century&nbsp;<em><a title=\"Declaration of the Rights of Man and of the Citizen\" href=\"http://en.wikipedia.org/wiki/Declaration_of_the_Rights_of_Man_and_of_the_Citizen\">Declaration of the Rights of Man and of the Citizen</a></em>. From the 17th to the early 20th century, France built the&nbsp;<a title=\"French colonial empire\" href=\"http://en.wikipedia.org/wiki/French_colonial_empire\">second-largest colonial empire</a>&nbsp;of the time, ruling large portions of first&nbsp;<a title=\"New France\" href=\"http://en.wikipedia.org/wiki/New_France\">North America</a>&nbsp;and&nbsp;<a title=\"French India\" href=\"http://en.wikipedia.org/wiki/French_India\">India</a>&nbsp;and then&nbsp;<a title=\"French West Africa\" href=\"http://en.wikipedia.org/wiki/French_West_Africa\">Northwest</a>&nbsp;and&nbsp;<a title=\"French Equatorial Africa\" href=\"http://en.wikipedia.org/wiki/French_Equatorial_Africa\">Central Africa</a>;<a title=\"French Madagascar\" href=\"http://en.wikipedia.org/wiki/French_Madagascar\">Madagascar</a>;&nbsp;<a title=\"French Indochina\" href=\"http://en.wikipedia.org/wiki/French_Indochina\">Indochina</a>&nbsp;and southeast&nbsp;<a class=\"mw-redirect\" title=\"French China\" href=\"http://en.wikipedia.org/wiki/French_China\">China</a>; and many&nbsp;<a title=\"French West Indies\" href=\"http://en.wikipedia.org/wiki/French_West_Indies\">Caribbean</a>&nbsp;and&nbsp;<a title=\"French Polynesia\" href=\"http://en.wikipedia.org/wiki/French_Polynesia\">Pacific Islands</a>.</p>\r\n<p>France is a&nbsp;<a title=\"Developed country\" href=\"http://en.wikipedia.org/wiki/Developed_country\">developed country</a>,<sup id=\"cite_ref-19\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-19\">[7]</a></sup>&nbsp;possessing the world\'s&nbsp;<a title=\"List of countries by GDP (nominal)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(nominal)\">fifth-largest</a>&nbsp;and Europe\'s<a title=\"List of sovereign states in Europe by GDP (nominal)\" href=\"http://en.wikipedia.org/wiki/List_of_sovereign_states_in_Europe_by_GDP_(nominal)\">second-largest</a>&nbsp;economy by&nbsp;<a class=\"mw-redirect\" title=\"Nominal GDP\" href=\"http://en.wikipedia.org/wiki/Nominal_GDP\">nominal GDP</a>. It is also the world\'s&nbsp;<a title=\"List of countries by GDP (PPP)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(PPP)\">ninth-largest</a>&nbsp;by&nbsp;<a class=\"mw-redirect\" title=\"GDP at purchasing power parity\" href=\"http://en.wikipedia.org/wiki/GDP_at_purchasing_power_parity\">GDP at purchasing power parity</a>.<sup id=\"cite_ref-20\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-20\">[8]</a></sup>&nbsp;France is the wealthiest nation in Europe &ndash; and the fourth-wealthiest in the world &ndash; in aggregate household wealth.<sup id=\"cite_ref-21\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-21\">[9]</a></sup>&nbsp;French citizens enjoy a high<a title=\"Standard of living\" href=\"http://en.wikipedia.org/wiki/Standard_of_living\">standard of living</a>, high&nbsp;<a title=\"Education Index\" href=\"http://en.wikipedia.org/wiki/Education_Index\">public education level</a>, and one of the world\'s longest&nbsp;<a title=\"List of countries by life expectancy\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_life_expectancy\">life expectancies</a>.<sup id=\"cite_ref-22\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-22\">[10]</a></sup>&nbsp;France has been listed as the world\'s \"best overall health care\" provider by the&nbsp;<a title=\"World Health Organization\" href=\"http://en.wikipedia.org/wiki/World_Health_Organization\">World Health Organization</a>.<sup id=\"cite_ref-23\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-23\">[11]</a></sup>&nbsp;It is the most-visited country in the world, receiving 79.5&nbsp;million foreign tourists annually.<sup id=\"cite_ref-tourism.stat_24-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-tourism.stat-24\">[12]</a></sup></p>\r\n<p>France has the world\'s&nbsp;<a title=\"List of countries by military expenditures\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_military_expenditures\">fifth-largest nominal military budget</a>,<sup id=\"cite_ref-SIPRI_Yearbook_2012_25-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-SIPRI_Yearbook_2012-25\">[13]</a></sup>&nbsp;as well as (in terms of personnel) the largest military in the&nbsp;<a title=\"European Union\" href=\"http://en.wikipedia.org/wiki/European_Union\">EU</a>,<sup class=\"Template-Fact\">[<em><a title=\"Wikipedia:Citation needed\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Citation_needed\"><span title=\"This claim needs references to reliable sources from November 2012\">citation needed</span></a></em>]</sup>&nbsp;the third-largest deployable force in&nbsp;<a title=\"NATO\" href=\"http://en.wikipedia.org/wiki/NATO\">NATO</a>, and the&nbsp;<a title=\"List of countries by number of military and paramilitary personnel\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_number_of_military_and_paramilitary_personnel\">26th-largest military</a>&nbsp;in the world. France also possesses the third-largest stockpile of&nbsp;<a title=\"List of states with nuclear weapons\" href=\"http://en.wikipedia.org/wiki/List_of_states_with_nuclear_weapons\">nuclear weapons</a>&nbsp;in the world<sup id=\"cite_ref-26\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-26\">[14]</a></sup>&nbsp;&ndash; with around 300 active warheads as of 25&nbsp;May&nbsp;2010&nbsp;&ndash; and the&nbsp;<a title=\"List of diplomatic missions of France\" href=\"http://en.wikipedia.org/wiki/List_of_diplomatic_missions_of_France\">world\'s second-largest diplomatic corps</a>&nbsp;(behind the&nbsp;<a class=\"mw-redirect\" title=\"State Department (US)\" href=\"http://en.wikipedia.org/wiki/State_Department_(US)\">United States</a>).<sup id=\"cite_ref-27\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-27\">[15]</a></sup>&nbsp;France is a founding member of the&nbsp;<a title=\"United Nations\" href=\"http://en.wikipedia.org/wiki/United_Nations\">United Nations</a>, one of the five&nbsp;<a title=\"Permanent members of the United Nations Security Council\" href=\"http://en.wikipedia.org/wiki/Permanent_members_of_the_United_Nations_Security_Council\">permanent members of the UN Security Council</a>, and a member of the<a title=\"Organisation internationale de la Francophonie\" href=\"http://en.wikipedia.org/wiki/Organisation_internationale_de_la_Francophonie\">Francophonie</a>, the&nbsp;<a title=\"G8\" href=\"http://en.wikipedia.org/wiki/G8\">G8</a>,&nbsp;<a title=\"G-20 major economies\" href=\"http://en.wikipedia.org/wiki/G-20_major_economies\">G20</a>, NATO,&nbsp;<a title=\"Organisation for Economic Co-operation and Development\" href=\"http://en.wikipedia.org/wiki/Organisation_for_Economic_Co-operation_and_Development\">OECD</a>,&nbsp;<a title=\"World Trade Organization\" href=\"http://en.wikipedia.org/wiki/World_Trade_Organization\">WTO</a>, and the&nbsp;<a title=\"Latin Union\" href=\"http://en.wikipedia.org/wiki/Latin_Union\">Latin Union</a>. It is also a founding and leading&nbsp;<a title=\"Member state of the European Union\" href=\"http://en.wikipedia.org/wiki/Member_state_of_the_European_Union\">member state of the European Union</a>&nbsp;and the largest EU state by area.<sup id=\"cite_ref-superficy_28-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-superficy-28\">[16]</a></sup>&nbsp;In 2011, France was listed 20th on the&nbsp;<a title=\"Human Development Index\" href=\"http://en.wikipedia.org/wiki/Human_Development_Index\">Human Development Index</a>&nbsp;and, in 2010, 24th on the&nbsp;<a title=\"Corruption Perceptions Index\" href=\"http://en.wikipedia.org/wiki/Corruption_Perceptions_Index\">Corruption Perceptions Index</a>.</p>', null);
INSERT INTO `module_cms_detail_2` VALUES ('132', '34', '3', 'France', 'france.jpg', '<p>France</p>\r\n<p>&nbsp;</p>\r\n<p><strong>France</strong>&nbsp;(<span class=\"nowrap\"><small>English</small>&nbsp;<span class=\"noexcerpt\"><a title=\"Listen\" href=\"http://upload.wikimedia.org/wikipedia/commons/5/51/En-us-France.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png\" alt=\"Listen\" width=\"11\" height=\"11\" /></a><sup><span class=\"IPA\"><a title=\"File:En-us-France.ogg\" href=\"http://en.wikipedia.org/wiki/File:En-us-France.ogg\">i</a></span></sup></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'f\' in \'find\'\">f</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'r\' in \'rye\'\">r</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/&aelig;/ short \'a\' in \'bad\'\">&aelig;</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;<span class=\"Unicode\" title=\"English pronunciation respelling\"><a title=\"Wikipedia:Pronunciation respelling key\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Pronunciation_respelling_key\"><em><strong><span class=\"smallcaps\"><span class=\"SMALLCAPS\"><span class=\"NOCAPS\">franss</span></span></span></strong></em></a></span>&nbsp;or&nbsp;<span class=\"nowrap\"><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'f\' in \'find\'\">f</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'r\' in \'rye\'\">r</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É‘Ë/ \'a\' in \'father\'\">É‘Ë</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;<span class=\"Unicode\" title=\"English pronunciation respelling\"><a title=\"Wikipedia:Pronunciation respelling key\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Pronunciation_respelling_key\"><em><strong><span class=\"smallcaps\"><span class=\"SMALLCAPS\"><span class=\"NOCAPS\">frahnss</span></span></span></strong></em></a></span>;&nbsp;<small>French:&nbsp;</small><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for French\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_French\">[fÊÉ‘Ìƒs]</a></span><small class=\"nowrap\">&nbsp;(<a title=\"File:Fr-France.ogg\" href=\"http://en.wikipedia.org/wiki/File:Fr-France.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/2/21/Speaker_Icon.svg/13px-Speaker_Icon.svg.png\" alt=\"\" width=\"13\" height=\"13\" /></a>&nbsp;<a class=\"internal\" title=\"Fr-France.ogg\" href=\"http://upload.wikimedia.org/wikipedia/commons/a/a3/Fr-France.ogg\">listen</a>)</small>), officially the&nbsp;<strong>French Republic</strong>&nbsp;(<a title=\"French language\" href=\"http://en.wikipedia.org/wiki/French_language\">French</a>:&nbsp;<span lang=\"fr\"><em>R&eacute;publique fran&ccedil;aise</em></span>&nbsp;<small><a title=\"French language\" href=\"http://en.wikipedia.org/wiki/French_language\">French</a>pronunciation:&nbsp;</small><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for French\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_French\">[Êepyblik fÊÉ‘ÌƒsÉ›z]</a></span>), is a&nbsp;<a title=\"Unitary state\" href=\"http://en.wikipedia.org/wiki/Unitary_state\">unitary</a>&nbsp;<a title=\"Semi-presidential system\" href=\"http://en.wikipedia.org/wiki/Semi-presidential_system\">semi-presidential</a>&nbsp;republic located mostly in&nbsp;<a title=\"Western Europe\" href=\"http://en.wikipedia.org/wiki/Western_Europe\">Western Europe</a>,<sup id=\"cite_ref-twelve_17-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-twelve-17\">[note 12]</a></sup>&nbsp;with several&nbsp;<a title=\"Overseas departments and territories of France\" href=\"http://en.wikipedia.org/wiki/Overseas_departments_and_territories_of_France\">overseas regions and territories</a>.&nbsp;<a title=\"Metropolitan France\" href=\"http://en.wikipedia.org/wiki/Metropolitan_France\">Metropolitan France</a>&nbsp;extends from the&nbsp;<a title=\"Mediterranean Sea\" href=\"http://en.wikipedia.org/wiki/Mediterranean_Sea\">Mediterranean Sea</a>&nbsp;to the&nbsp;<a title=\"English Channel\" href=\"http://en.wikipedia.org/wiki/English_Channel\">English Channel</a>&nbsp;and the&nbsp;<a title=\"North Sea\" href=\"http://en.wikipedia.org/wiki/North_Sea\">North Sea</a>, and from the&nbsp;<a title=\"Rhine\" href=\"http://en.wikipedia.org/wiki/Rhine\">Rhine</a>&nbsp;to the&nbsp;<a title=\"Atlantic Ocean\" href=\"http://en.wikipedia.org/wiki/Atlantic_Ocean\">Atlantic Ocean</a>. From its shape, it is often referred to in French as&nbsp;<em><span lang=\"fr\">l&rsquo;Hexagone</span></em>&nbsp;(\"The&nbsp;<a title=\"Hexagon\" href=\"http://en.wikipedia.org/wiki/Hexagon\">Hexagon</a>\").</p>\r\n<p>France is the largest country in Western Europe and the third-largest in Europe as a whole. It possesses the second-largest&nbsp;<a title=\"Exclusive economic zone\" href=\"http://en.wikipedia.org/wiki/Exclusive_economic_zone\">exclusive economic zone</a>&nbsp;in the world. France has been a&nbsp;<a class=\"mw-redirect\" title=\"Major power\" href=\"http://en.wikipedia.org/wiki/Major_power\">major power</a>&nbsp;with strong&nbsp;<a title=\"Culture of France\" href=\"http://en.wikipedia.org/wiki/Culture_of_France\">cultural</a>,&nbsp;<a title=\"Economy of France\" href=\"http://en.wikipedia.org/wiki/Economy_of_France\">economic</a>,&nbsp;<a title=\"French Armed Forces\" href=\"http://en.wikipedia.org/wiki/French_Armed_Forces\">military</a>, and&nbsp;<a title=\"Foreign relations of France\" href=\"http://en.wikipedia.org/wiki/Foreign_relations_of_France\">political</a>&nbsp;influence in Europe and around the world.<sup id=\"cite_ref-18\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-18\">[6]</a></sup>&nbsp;France has its main ideals expressed in the 18th-century&nbsp;<em><a title=\"Declaration of the Rights of Man and of the Citizen\" href=\"http://en.wikipedia.org/wiki/Declaration_of_the_Rights_of_Man_and_of_the_Citizen\">Declaration of the Rights of Man and of the Citizen</a></em>. From the 17th to the early 20th century, France built the&nbsp;<a title=\"French colonial empire\" href=\"http://en.wikipedia.org/wiki/French_colonial_empire\">second-largest colonial empire</a>&nbsp;of the time, ruling large portions of first&nbsp;<a title=\"New France\" href=\"http://en.wikipedia.org/wiki/New_France\">North America</a>&nbsp;and&nbsp;<a title=\"French India\" href=\"http://en.wikipedia.org/wiki/French_India\">India</a>&nbsp;and then&nbsp;<a title=\"French West Africa\" href=\"http://en.wikipedia.org/wiki/French_West_Africa\">Northwest</a>&nbsp;and&nbsp;<a title=\"French Equatorial Africa\" href=\"http://en.wikipedia.org/wiki/French_Equatorial_Africa\">Central Africa</a>;<a title=\"French Madagascar\" href=\"http://en.wikipedia.org/wiki/French_Madagascar\">Madagascar</a>;&nbsp;<a title=\"French Indochina\" href=\"http://en.wikipedia.org/wiki/French_Indochina\">Indochina</a>&nbsp;and southeast&nbsp;<a class=\"mw-redirect\" title=\"French China\" href=\"http://en.wikipedia.org/wiki/French_China\">China</a>; and many&nbsp;<a title=\"French West Indies\" href=\"http://en.wikipedia.org/wiki/French_West_Indies\">Caribbean</a>&nbsp;and&nbsp;<a title=\"French Polynesia\" href=\"http://en.wikipedia.org/wiki/French_Polynesia\">Pacific Islands</a>.</p>\r\n<p>France is a&nbsp;<a title=\"Developed country\" href=\"http://en.wikipedia.org/wiki/Developed_country\">developed country</a>,<sup id=\"cite_ref-19\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-19\">[7]</a></sup>&nbsp;possessing the world\'s&nbsp;<a title=\"List of countries by GDP (nominal)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(nominal)\">fifth-largest</a>&nbsp;and Europe\'s<a title=\"List of sovereign states in Europe by GDP (nominal)\" href=\"http://en.wikipedia.org/wiki/List_of_sovereign_states_in_Europe_by_GDP_(nominal)\">second-largest</a>&nbsp;economy by&nbsp;<a class=\"mw-redirect\" title=\"Nominal GDP\" href=\"http://en.wikipedia.org/wiki/Nominal_GDP\">nominal GDP</a>. It is also the world\'s&nbsp;<a title=\"List of countries by GDP (PPP)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(PPP)\">ninth-largest</a>&nbsp;by&nbsp;<a class=\"mw-redirect\" title=\"GDP at purchasing power parity\" href=\"http://en.wikipedia.org/wiki/GDP_at_purchasing_power_parity\">GDP at purchasing power parity</a>.<sup id=\"cite_ref-20\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-20\">[8]</a></sup>&nbsp;France is the wealthiest nation in Europe &ndash; and the fourth-wealthiest in the world &ndash; in aggregate household wealth.<sup id=\"cite_ref-21\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-21\">[9]</a></sup>&nbsp;French citizens enjoy a high<a title=\"Standard of living\" href=\"http://en.wikipedia.org/wiki/Standard_of_living\">standard of living</a>, high&nbsp;<a title=\"Education Index\" href=\"http://en.wikipedia.org/wiki/Education_Index\">public education level</a>, and one of the world\'s longest&nbsp;<a title=\"List of countries by life expectancy\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_life_expectancy\">life expectancies</a>.<sup id=\"cite_ref-22\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-22\">[10]</a></sup>&nbsp;France has been listed as the world\'s \"best overall health care\" provider by the&nbsp;<a title=\"World Health Organization\" href=\"http://en.wikipedia.org/wiki/World_Health_Organization\">World Health Organization</a>.<sup id=\"cite_ref-23\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-23\">[11]</a></sup>&nbsp;It is the most-visited country in the world, receiving 79.5&nbsp;million foreign tourists annually.<sup id=\"cite_ref-tourism.stat_24-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-tourism.stat-24\">[12]</a></sup></p>\r\n<p>France has the world\'s&nbsp;<a title=\"List of countries by military expenditures\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_military_expenditures\">fifth-largest nominal military budget</a>,<sup id=\"cite_ref-SIPRI_Yearbook_2012_25-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-SIPRI_Yearbook_2012-25\">[13]</a></sup>&nbsp;as well as (in terms of personnel) the largest military in the&nbsp;<a title=\"European Union\" href=\"http://en.wikipedia.org/wiki/European_Union\">EU</a>,<sup class=\"Template-Fact\">[<em><a title=\"Wikipedia:Citation needed\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Citation_needed\"><span title=\"This claim needs references to reliable sources from November 2012\">citation needed</span></a></em>]</sup>&nbsp;the third-largest deployable force in&nbsp;<a title=\"NATO\" href=\"http://en.wikipedia.org/wiki/NATO\">NATO</a>, and the&nbsp;<a title=\"List of countries by number of military and paramilitary personnel\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_number_of_military_and_paramilitary_personnel\">26th-largest military</a>&nbsp;in the world. France also possesses the third-largest stockpile of&nbsp;<a title=\"List of states with nuclear weapons\" href=\"http://en.wikipedia.org/wiki/List_of_states_with_nuclear_weapons\">nuclear weapons</a>&nbsp;in the world<sup id=\"cite_ref-26\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-26\">[14]</a></sup>&nbsp;&ndash; with around 300 active warheads as of 25&nbsp;May&nbsp;2010&nbsp;&ndash; and the&nbsp;<a title=\"List of diplomatic missions of France\" href=\"http://en.wikipedia.org/wiki/List_of_diplomatic_missions_of_France\">world\'s second-largest diplomatic corps</a>&nbsp;(behind the&nbsp;<a class=\"mw-redirect\" title=\"State Department (US)\" href=\"http://en.wikipedia.org/wiki/State_Department_(US)\">United States</a>).<sup id=\"cite_ref-27\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-27\">[15]</a></sup>&nbsp;France is a founding member of the&nbsp;<a title=\"United Nations\" href=\"http://en.wikipedia.org/wiki/United_Nations\">United Nations</a>, one of the five&nbsp;<a title=\"Permanent members of the United Nations Security Council\" href=\"http://en.wikipedia.org/wiki/Permanent_members_of_the_United_Nations_Security_Council\">permanent members of the UN Security Council</a>, and a member of the<a title=\"Organisation internationale de la Francophonie\" href=\"http://en.wikipedia.org/wiki/Organisation_internationale_de_la_Francophonie\">Francophonie</a>, the&nbsp;<a title=\"G8\" href=\"http://en.wikipedia.org/wiki/G8\">G8</a>,&nbsp;<a title=\"G-20 major economies\" href=\"http://en.wikipedia.org/wiki/G-20_major_economies\">G20</a>, NATO,&nbsp;<a title=\"Organisation for Economic Co-operation and Development\" href=\"http://en.wikipedia.org/wiki/Organisation_for_Economic_Co-operation_and_Development\">OECD</a>,&nbsp;<a title=\"World Trade Organization\" href=\"http://en.wikipedia.org/wiki/World_Trade_Organization\">WTO</a>, and the&nbsp;<a title=\"Latin Union\" href=\"http://en.wikipedia.org/wiki/Latin_Union\">Latin Union</a>. It is also a founding and leading&nbsp;<a title=\"Member state of the European Union\" href=\"http://en.wikipedia.org/wiki/Member_state_of_the_European_Union\">member state of the European Union</a>&nbsp;and the largest EU state by area.<sup id=\"cite_ref-superficy_28-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-superficy-28\">[16]</a></sup>&nbsp;In 2011, France was listed 20th on the&nbsp;<a title=\"Human Development Index\" href=\"http://en.wikipedia.org/wiki/Human_Development_Index\">Human Development Index</a>&nbsp;and, in 2010, 24th on the&nbsp;<a title=\"Corruption Perceptions Index\" href=\"http://en.wikipedia.org/wiki/Corruption_Perceptions_Index\">Corruption Perceptions Index</a>.</p>', null);
INSERT INTO `module_cms_detail_2` VALUES ('133', '34', '4', 'France', 'france.jpg', '<p>France</p>\r\n<p>&nbsp;</p>\r\n<p><strong>France</strong>&nbsp;(<span class=\"nowrap\"><small>English</small>&nbsp;<span class=\"noexcerpt\"><a title=\"Listen\" href=\"http://upload.wikimedia.org/wikipedia/commons/5/51/En-us-France.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png\" alt=\"Listen\" width=\"11\" height=\"11\" /></a><sup><span class=\"IPA\"><a title=\"File:En-us-France.ogg\" href=\"http://en.wikipedia.org/wiki/File:En-us-France.ogg\">i</a></span></sup></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'f\' in \'find\'\">f</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'r\' in \'rye\'\">r</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/&aelig;/ short \'a\' in \'bad\'\">&aelig;</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;<span class=\"Unicode\" title=\"English pronunciation respelling\"><a title=\"Wikipedia:Pronunciation respelling key\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Pronunciation_respelling_key\"><em><strong><span class=\"smallcaps\"><span class=\"SMALLCAPS\"><span class=\"NOCAPS\">franss</span></span></span></strong></em></a></span>&nbsp;or&nbsp;<span class=\"nowrap\"><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/Ëˆ/ primary stress follows\">Ëˆ</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'f\' in \'find\'\">f</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'r\' in \'rye\'\">r</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"/É‘Ë/ \'a\' in \'father\'\">É‘Ë</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'n\' in \'nigh\'\">n</span></a></span><span class=\"IPA\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English#Key\"><span title=\"\'s\' in \'sigh\'\">s</span></a></span><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for English\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_English\">/</a></span></span>&nbsp;<span class=\"Unicode\" title=\"English pronunciation respelling\"><a title=\"Wikipedia:Pronunciation respelling key\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Pronunciation_respelling_key\"><em><strong><span class=\"smallcaps\"><span class=\"SMALLCAPS\"><span class=\"NOCAPS\">frahnss</span></span></span></strong></em></a></span>;&nbsp;<small>French:&nbsp;</small><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for French\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_French\">[fÊÉ‘Ìƒs]</a></span><small class=\"nowrap\">&nbsp;(<a title=\"File:Fr-France.ogg\" href=\"http://en.wikipedia.org/wiki/File:Fr-France.ogg\"><img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/2/21/Speaker_Icon.svg/13px-Speaker_Icon.svg.png\" alt=\"\" width=\"13\" height=\"13\" /></a>&nbsp;<a class=\"internal\" title=\"Fr-France.ogg\" href=\"http://upload.wikimedia.org/wikipedia/commons/a/a3/Fr-France.ogg\">listen</a>)</small>), officially the&nbsp;<strong>French Republic</strong>&nbsp;(<a title=\"French language\" href=\"http://en.wikipedia.org/wiki/French_language\">French</a>:&nbsp;<span lang=\"fr\"><em>R&eacute;publique fran&ccedil;aise</em></span>&nbsp;<small><a title=\"French language\" href=\"http://en.wikipedia.org/wiki/French_language\">French</a>pronunciation:&nbsp;</small><span class=\"IPA\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a title=\"Help:IPA for French\" href=\"http://en.wikipedia.org/wiki/Help:IPA_for_French\">[Êepyblik fÊÉ‘ÌƒsÉ›z]</a></span>), is a&nbsp;<a title=\"Unitary state\" href=\"http://en.wikipedia.org/wiki/Unitary_state\">unitary</a>&nbsp;<a title=\"Semi-presidential system\" href=\"http://en.wikipedia.org/wiki/Semi-presidential_system\">semi-presidential</a>&nbsp;republic located mostly in&nbsp;<a title=\"Western Europe\" href=\"http://en.wikipedia.org/wiki/Western_Europe\">Western Europe</a>,<sup id=\"cite_ref-twelve_17-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-twelve-17\">[note 12]</a></sup>&nbsp;with several&nbsp;<a title=\"Overseas departments and territories of France\" href=\"http://en.wikipedia.org/wiki/Overseas_departments_and_territories_of_France\">overseas regions and territories</a>.&nbsp;<a title=\"Metropolitan France\" href=\"http://en.wikipedia.org/wiki/Metropolitan_France\">Metropolitan France</a>&nbsp;extends from the&nbsp;<a title=\"Mediterranean Sea\" href=\"http://en.wikipedia.org/wiki/Mediterranean_Sea\">Mediterranean Sea</a>&nbsp;to the&nbsp;<a title=\"English Channel\" href=\"http://en.wikipedia.org/wiki/English_Channel\">English Channel</a>&nbsp;and the&nbsp;<a title=\"North Sea\" href=\"http://en.wikipedia.org/wiki/North_Sea\">North Sea</a>, and from the&nbsp;<a title=\"Rhine\" href=\"http://en.wikipedia.org/wiki/Rhine\">Rhine</a>&nbsp;to the&nbsp;<a title=\"Atlantic Ocean\" href=\"http://en.wikipedia.org/wiki/Atlantic_Ocean\">Atlantic Ocean</a>. From its shape, it is often referred to in French as&nbsp;<em><span lang=\"fr\">l&rsquo;Hexagone</span></em>&nbsp;(\"The&nbsp;<a title=\"Hexagon\" href=\"http://en.wikipedia.org/wiki/Hexagon\">Hexagon</a>\").</p>\r\n<p>France is the largest country in Western Europe and the third-largest in Europe as a whole. It possesses the second-largest&nbsp;<a title=\"Exclusive economic zone\" href=\"http://en.wikipedia.org/wiki/Exclusive_economic_zone\">exclusive economic zone</a>&nbsp;in the world. France has been a&nbsp;<a class=\"mw-redirect\" title=\"Major power\" href=\"http://en.wikipedia.org/wiki/Major_power\">major power</a>&nbsp;with strong&nbsp;<a title=\"Culture of France\" href=\"http://en.wikipedia.org/wiki/Culture_of_France\">cultural</a>,&nbsp;<a title=\"Economy of France\" href=\"http://en.wikipedia.org/wiki/Economy_of_France\">economic</a>,&nbsp;<a title=\"French Armed Forces\" href=\"http://en.wikipedia.org/wiki/French_Armed_Forces\">military</a>, and&nbsp;<a title=\"Foreign relations of France\" href=\"http://en.wikipedia.org/wiki/Foreign_relations_of_France\">political</a>&nbsp;influence in Europe and around the world.<sup id=\"cite_ref-18\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-18\">[6]</a></sup>&nbsp;France has its main ideals expressed in the 18th-century&nbsp;<em><a title=\"Declaration of the Rights of Man and of the Citizen\" href=\"http://en.wikipedia.org/wiki/Declaration_of_the_Rights_of_Man_and_of_the_Citizen\">Declaration of the Rights of Man and of the Citizen</a></em>. From the 17th to the early 20th century, France built the&nbsp;<a title=\"French colonial empire\" href=\"http://en.wikipedia.org/wiki/French_colonial_empire\">second-largest colonial empire</a>&nbsp;of the time, ruling large portions of first&nbsp;<a title=\"New France\" href=\"http://en.wikipedia.org/wiki/New_France\">North America</a>&nbsp;and&nbsp;<a title=\"French India\" href=\"http://en.wikipedia.org/wiki/French_India\">India</a>&nbsp;and then&nbsp;<a title=\"French West Africa\" href=\"http://en.wikipedia.org/wiki/French_West_Africa\">Northwest</a>&nbsp;and&nbsp;<a title=\"French Equatorial Africa\" href=\"http://en.wikipedia.org/wiki/French_Equatorial_Africa\">Central Africa</a>;<a title=\"French Madagascar\" href=\"http://en.wikipedia.org/wiki/French_Madagascar\">Madagascar</a>;&nbsp;<a title=\"French Indochina\" href=\"http://en.wikipedia.org/wiki/French_Indochina\">Indochina</a>&nbsp;and southeast&nbsp;<a class=\"mw-redirect\" title=\"French China\" href=\"http://en.wikipedia.org/wiki/French_China\">China</a>; and many&nbsp;<a title=\"French West Indies\" href=\"http://en.wikipedia.org/wiki/French_West_Indies\">Caribbean</a>&nbsp;and&nbsp;<a title=\"French Polynesia\" href=\"http://en.wikipedia.org/wiki/French_Polynesia\">Pacific Islands</a>.</p>\r\n<p>France is a&nbsp;<a title=\"Developed country\" href=\"http://en.wikipedia.org/wiki/Developed_country\">developed country</a>,<sup id=\"cite_ref-19\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-19\">[7]</a></sup>&nbsp;possessing the world\'s&nbsp;<a title=\"List of countries by GDP (nominal)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(nominal)\">fifth-largest</a>&nbsp;and Europe\'s<a title=\"List of sovereign states in Europe by GDP (nominal)\" href=\"http://en.wikipedia.org/wiki/List_of_sovereign_states_in_Europe_by_GDP_(nominal)\">second-largest</a>&nbsp;economy by&nbsp;<a class=\"mw-redirect\" title=\"Nominal GDP\" href=\"http://en.wikipedia.org/wiki/Nominal_GDP\">nominal GDP</a>. It is also the world\'s&nbsp;<a title=\"List of countries by GDP (PPP)\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_GDP_(PPP)\">ninth-largest</a>&nbsp;by&nbsp;<a class=\"mw-redirect\" title=\"GDP at purchasing power parity\" href=\"http://en.wikipedia.org/wiki/GDP_at_purchasing_power_parity\">GDP at purchasing power parity</a>.<sup id=\"cite_ref-20\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-20\">[8]</a></sup>&nbsp;France is the wealthiest nation in Europe &ndash; and the fourth-wealthiest in the world &ndash; in aggregate household wealth.<sup id=\"cite_ref-21\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-21\">[9]</a></sup>&nbsp;French citizens enjoy a high<a title=\"Standard of living\" href=\"http://en.wikipedia.org/wiki/Standard_of_living\">standard of living</a>, high&nbsp;<a title=\"Education Index\" href=\"http://en.wikipedia.org/wiki/Education_Index\">public education level</a>, and one of the world\'s longest&nbsp;<a title=\"List of countries by life expectancy\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_life_expectancy\">life expectancies</a>.<sup id=\"cite_ref-22\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-22\">[10]</a></sup>&nbsp;France has been listed as the world\'s \"best overall health care\" provider by the&nbsp;<a title=\"World Health Organization\" href=\"http://en.wikipedia.org/wiki/World_Health_Organization\">World Health Organization</a>.<sup id=\"cite_ref-23\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-23\">[11]</a></sup>&nbsp;It is the most-visited country in the world, receiving 79.5&nbsp;million foreign tourists annually.<sup id=\"cite_ref-tourism.stat_24-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-tourism.stat-24\">[12]</a></sup></p>\r\n<p>France has the world\'s&nbsp;<a title=\"List of countries by military expenditures\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_military_expenditures\">fifth-largest nominal military budget</a>,<sup id=\"cite_ref-SIPRI_Yearbook_2012_25-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-SIPRI_Yearbook_2012-25\">[13]</a></sup>&nbsp;as well as (in terms of personnel) the largest military in the&nbsp;<a title=\"European Union\" href=\"http://en.wikipedia.org/wiki/European_Union\">EU</a>,<sup class=\"Template-Fact\">[<em><a title=\"Wikipedia:Citation needed\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Citation_needed\"><span title=\"This claim needs references to reliable sources from November 2012\">citation needed</span></a></em>]</sup>&nbsp;the third-largest deployable force in&nbsp;<a title=\"NATO\" href=\"http://en.wikipedia.org/wiki/NATO\">NATO</a>, and the&nbsp;<a title=\"List of countries by number of military and paramilitary personnel\" href=\"http://en.wikipedia.org/wiki/List_of_countries_by_number_of_military_and_paramilitary_personnel\">26th-largest military</a>&nbsp;in the world. France also possesses the third-largest stockpile of&nbsp;<a title=\"List of states with nuclear weapons\" href=\"http://en.wikipedia.org/wiki/List_of_states_with_nuclear_weapons\">nuclear weapons</a>&nbsp;in the world<sup id=\"cite_ref-26\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-26\">[14]</a></sup>&nbsp;&ndash; with around 300 active warheads as of 25&nbsp;May&nbsp;2010&nbsp;&ndash; and the&nbsp;<a title=\"List of diplomatic missions of France\" href=\"http://en.wikipedia.org/wiki/List_of_diplomatic_missions_of_France\">world\'s second-largest diplomatic corps</a>&nbsp;(behind the&nbsp;<a class=\"mw-redirect\" title=\"State Department (US)\" href=\"http://en.wikipedia.org/wiki/State_Department_(US)\">United States</a>).<sup id=\"cite_ref-27\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-27\">[15]</a></sup>&nbsp;France is a founding member of the&nbsp;<a title=\"United Nations\" href=\"http://en.wikipedia.org/wiki/United_Nations\">United Nations</a>, one of the five&nbsp;<a title=\"Permanent members of the United Nations Security Council\" href=\"http://en.wikipedia.org/wiki/Permanent_members_of_the_United_Nations_Security_Council\">permanent members of the UN Security Council</a>, and a member of the<a title=\"Organisation internationale de la Francophonie\" href=\"http://en.wikipedia.org/wiki/Organisation_internationale_de_la_Francophonie\">Francophonie</a>, the&nbsp;<a title=\"G8\" href=\"http://en.wikipedia.org/wiki/G8\">G8</a>,&nbsp;<a title=\"G-20 major economies\" href=\"http://en.wikipedia.org/wiki/G-20_major_economies\">G20</a>, NATO,&nbsp;<a title=\"Organisation for Economic Co-operation and Development\" href=\"http://en.wikipedia.org/wiki/Organisation_for_Economic_Co-operation_and_Development\">OECD</a>,&nbsp;<a title=\"World Trade Organization\" href=\"http://en.wikipedia.org/wiki/World_Trade_Organization\">WTO</a>, and the&nbsp;<a title=\"Latin Union\" href=\"http://en.wikipedia.org/wiki/Latin_Union\">Latin Union</a>. It is also a founding and leading&nbsp;<a title=\"Member state of the European Union\" href=\"http://en.wikipedia.org/wiki/Member_state_of_the_European_Union\">member state of the European Union</a>&nbsp;and the largest EU state by area.<sup id=\"cite_ref-superficy_28-0\" class=\"reference\"><a href=\"http://en.wikipedia.org/wiki/France#cite_note-superficy-28\">[16]</a></sup>&nbsp;In 2011, France was listed 20th on the&nbsp;<a title=\"Human Development Index\" href=\"http://en.wikipedia.org/wiki/Human_Development_Index\">Human Development Index</a>&nbsp;and, in 2010, 24th on the&nbsp;<a title=\"Corruption Perceptions Index\" href=\"http://en.wikipedia.org/wiki/Corruption_Perceptions_Index\">Corruption Perceptions Index</a>.</p>', null);
