INSERT INTO `module_cms_detail_2` VALUES ('192', '51', '1', 'Success Stories', 'schindler.png', '<div class=\"post-meta fix\">\r\n<div class=\"post-thumb\"><a title=\"Permanenter Link zu Success Story Schindler\" href=\"http://www.meta-concept.ch/schindler-aufzuge-ag-ebikon/581\" rel=\"bookmark\"><img class=\"attachment-thumbnail wp-post-image\" src=\"http://www.meta-concept.ch/wp-content/uploads/2011/08/Schindler_logo_small.png\" alt=\"Schindler_logo_small\" width=\"100\" height=\"90\" /></a></div>\r\n<div class=\"post-header fix \">\r\n<div class=\"post-title-section fix\">\r\n<div class=\"post-title fix\">\r\n<h1 class=\"entry-title\"><span style=\"color: #888888;\">Success Story Schindler</span></h1>\r\n<div class=\"metabar\"><span style=\"color: #888888;\"><em><span class=\"sword\">by</span>&nbsp;<span class=\"author vcard\"><span class=\"fn\"><a title=\"Beitr&auml;ge von rzurbruegg\" href=\"http://www.meta-concept.ch/author/rzurbruegg\" rel=\"author\"><span style=\"color: #888888;\">RZURBRUEGG</span></a></span></span>&nbsp;<span class=\"sword\">on</span>&nbsp;<span class=\"date time published\" title=\"2011-08-03T15:58:44+0200\">3. AUGUST 2011</span>&nbsp;&middot;&nbsp;<span class=\"sword\">in</span>&nbsp;<span class=\"categories\"><a title=\"Alle Beitr&auml;ge in Success Story ansehen\" href=\"http://www.meta-concept.ch/category/success-story\" rel=\"category tag\"><span style=\"color: #888888;\">SUCCESS STORY</span></a></span></em></span></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"entry_wrap fix\">\r\n<div class=\"entry_content\">\r\n<p><span style=\"font-family: helvetica; color: #888888;\">Aufgrund der technischen &Uuml;berarbeitung einer Komponenten-Baureihe f&uuml;r Aufzugssysteme war eine umfassende Aktualisierung der Komponenten-Dokumentation notwendig. F&uuml;r diese Aufgabe konnte Ren&eacute; Zurbr&uuml;gg, angesichts seiner Erfahrung im Bereich der Aufzugskomponenten, als idealer Partner gewonnen werden. Seine selbstst&auml;ndige Arbeitsweise sowie sein aktives und konstruktives Einbringen von Verbesserungen unterst&uuml;tzen die Zusammenarbeit sehr.</span></p>\r\n<p><span style=\"font-family: helvetica; color: #888888;\">Dies erm&ouml;glichte zudem eine kurze Bearbeitungszeit und eine fristgerechte Fertigstellung der Dokumente. Weiterhin trug die Anwesenheit von Ren&eacute; Zurbr&uuml;gg vor Ort und die damit verbundenen kurzen Kommunikationswege zu einer effizienten Arbeitsweise bei. Mit dieser Aufgabe wurde die seit langem bestehende gute Zusammenarbeit mit Ren&eacute; Zurbr&uuml;gg best&auml;tigt.</span></p>\r\n<p><span style=\"font-family: helvetica; color: #888888;\"><em>Marcus Junig, Entwicklungsingenieur, Safety Components, Fa. Schindler Aufz&uuml;ge Ebikon</em></span></p>\r\n</div>\r\n</div>', null);
