INSERT INTO `module_events_detail` VALUES ('48', '15', '3', '2013-07-19 19:00:00', '2013-07-19 23:00:00', 'Laura Mvula', '<h3><span style=\"font-family: arial, helvetica, sans-serif;\">Laura Mvula</span></h3>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif;\"><strong style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-family: arial, helvetica, sans-serif;\">19. JULI, KKL, LUZERNER SAAL</span></strong></span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif;\"><img src=\"http://login.appstart.ch/imghost/0/33/66430/Events/laramvula-event.jpg\" alt=\"\" width=\"100%\" height=\"\" /></span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif;\">F&uuml;r die renommierte BBC geh&ouml;rt sie zu den vielversprechendsten Newcomern 2013, die englischen Kritiker lieben sie und nominierten sie f&uuml;r einen Brit-Award. Bei Laura Mvula braucht es nicht viel Mut, ihr eine grosse Karriere zu prophezeien: Auf den Spuren von Nina Simone vermengt die 26-J&auml;hrige Soul und Klassik mit ihren afrikanischen Wurzeln. Das Resultat: Ein faszinierender Sound, getragen von einer einzigartigen, rauen und doch weichen Stimme. Laura Mvula ist das Blue Balls Face 2013 und spielt am Festival ihr erstes Schweizer Konzert.</span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif;\"><br /></span></p>', 'eventKKL.jpg', '', 'Daily', '2', '20/02/2013 00:0', '7', '2013-02-07 15:46:00', '7', '2013-01-25 19:35:55');
INSERT INTO `module_events_detail` VALUES ('49', '16', '3', '2013-07-20 19:00:00', '2013-07-20 23:00:00', 'Ane Brun', '<h3><span style=\"font-family: arial, helvetica, sans-serif;\">Ane Brun</span></h3>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif;\"><strong style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-family: arial, helvetica, sans-serif;\">20. JULI, KKL, LUZERNER SAAL</span></strong></span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif; color: #000000;\"><img src=\"http://www.biznessapps.com/imghost/0/33/66430/Events/anebrun-event.jpg\" alt=\"\" width=\"100%\" height=\"\" /></span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif;\">Skandinavien erweist sich immer wieder als Biotop f&uuml;r bezaubernde Pop-Musik. W&auml;hrend viele ihrer Kollegen aus dem hohen Norden entweder mit elektronischen, oder mit harten Kl&auml;ngen die Welt erobern, hat sich Ane Brun f&uuml;r die leisen Pfade entschieden. Mit dem vertr&auml;umten, k&uuml;nstlerischen Folk wurde sie in ihrer Heimat Norwegen zum Superstar &ndash; w&auml;hrend sie hierzulande immer noch als gut geh&uuml;teter Geheimtipp gilt.</span></p>\r\n<p>&nbsp;</p>', 'eventKKL.jpg', '', 'Daily', '1', '1', '7', '2013-01-25 19:37:06', '7', '2013-01-25 19:37:06');
INSERT INTO `module_events_detail` VALUES ('50', '17', '3', '2013-07-23 19:00:00', '2013-07-23 23:00:00', 'James Morrison', '<h3><span style=\"font-family: arial, helvetica, sans-serif;\">James Morrison</span></h3>\r\n<p><strong><span style=\"font-family: arial, helvetica, sans-serif;\">23. JULI, KKL, LUZERNER SAAL</span></strong></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif; color: #000000;\"><img src=\"http://login.appstart.ch/imghost/0/33/66430/Events/jamesmorrison-event.jpg\" alt=\"\" width=\"100%\" height=\"\" /></span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif;\">Drei Songs in den Top 10 der Schweizer Charts, ein Album auf Platz eins: Manchmal setzt sich musikalische Qualit&auml;t auch im Mainstream durch. Mit drei Alben hat sich James Morrison als eine der f&uuml;hrenden Soulstimmen im Pop etabliert. Kein Wunder spielt er sonst in den ganz grossen Hallen. Das Blue Balls macht es m&ouml;glich, ihn im Sommer in einem f&uuml;r seine Verh&auml;ltnisse gerade zu intimen Rahmen zu sehen.</span></p>\r\n<p>&nbsp;</p>', 'eventKKL.jpg', '', 'Daily', '1', '1', '7', '2013-01-25 19:39:36', '7', '2013-01-25 19:39:36');
